window.__NUXT__=(function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C){return {staticAssetsBase:"\u002F_nuxt\u002Fstatic\u002F1689892256",layout:"kaart",error:o,state:{breakpoints:{smUp:[h,i,j,k],mdUp:[i,j,k],lgUp:[j,k],xlUp:[k],xsDown:[l],smDown:[h,l],mdDown:[i,h,l],lgDown:[j,i,h,l]},data:{selectedCategories:[],selectedLocations:[],selectedRoute:o},i18n:{routeParams:{}}},serverRendered:a,routePath:"\u002Fsights\u002F62ee4a2ab974cb2998dd112a",config:{locations:[{id:"62e97078cb24f8f4fa9997b3",name:"Camping Waddenzee",category:n,coordinates:"52.88998919461017, 4.921698403712074",description:"\u003Cp\u003ESinds eind jaren '50 runnen wij, de Familie Tijsen, met veel toewijding en plezier Camping Waddenzee. Vooral de persoonlijke aandacht en de gemoedelijke sfeer worden door onze gasten zeer gewaardeerd én dat vinden wij erg belangrijk.\u003C\u002Fp\u003E\u003Cp\u003EOnlangs hebben wij ons nieuwe \"multifunctionele gebouw\" in gebruik genomen. Het complete aangezicht van de Camping is gemoderniseerd, de speeltuin is onder handen genomen en er is een heus panna-court aangelegd.\u003C\u002Fp\u003E\u003Cp\u003EHeeft u ook al kennisgemaakt met Café restaurant Waddenzee? Dit gezellige Café en restaurant is een heerlijke en gezellige plek voor de welbekende Bingo, kinder entertainment, feestavonden, uw vers gebakken broodjes en voor een hapje en drankje.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ETot snel?\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ESince the late 1950s we, the Tijsen family, have been running Camping Waddenzee with great dedication and pleasure. The personal attention and the friendly atmosphere are especially appreciated by our guests and we think that is very important.\u003C\u002Fp\u003E\u003Cp\u003EWe recently took our new \"functional building\" into use. The entire face of the Campsite has been modernised, the playground has been overhauled and a real panna court has been constructed.\u003C\u002Fp\u003E\u003Cp\u003EHave you already become acquainted with Café restaurant Waddenzee? This cozy Café and restaurant is a wonderful and cozy place for the well-known Bingo, children's entertainment, party evenings, your freshly baked sandwiches and for a snack and drink.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ESee you soon?\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ESeit den späten 1950er Jahren betreiben wir, die Familie Tijsen, Camping Waddenzee mit viel Hingabe und Freude. Die persönliche Betreuung und die freundliche Atmosphäre werden von unseren Gästen besonders geschätzt und das ist uns sehr wichtig.\u003C\u002Fp\u003E\u003Cp\u003EVor kurzem haben wir unser neues „Funktionsgebäude“ in Betrieb genommen. Das gesamte Gesicht des Campingplatzes wurde modernisiert, der Spielplatz wurde überarbeitet und ein echter Panna-Platz wurde gebaut.\u003C\u002Fp\u003E\u003Cp\u003EHaben Sie das Café-Restaurant Waddenzee bereits kennengelernt? Dieses gemütliche Café und Restaurant ist ein wunderbarer und gemütlicher Ort für das bekannte Bingo, Kinderanimation, Partyabende, Ihre frisch gebackenen Sandwiches und für einen Snack und ein Getränk.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBis bald?\u003C\u002Fp\u003E",email:"info@camping-waddenzee.nl",phone:"0227591431",site:"https:\u002F\u002Fwww.camping-waddenzee.nl\u002F",enabled:a},{id:"62e970edcb24f8f4fa9997b4",name:"Charmelogies Wad Zout 't",category:n,coordinates:"52.894771142004544, 4.9128214116342335",description:"\u003Cp\u003EBij aankomst bij WatZout’t ervaren veel mensen hetzelfde. De neiging om als vanzelf je horloge af te doen en je mobieltje uit te zetten. De koffers zijn ingepakt, voor de zoveelste keer nagelopen of u echt niets vergeten bent. De buurvrouw zorgt voor de kat en de planten. De deur op slot, en met de auto richting de eerste vakantiefile… En zo uit alle haast en hectiek ben je dan opeens bij WadZout't. Stilte… Frisse lucht, het ruizen van de zee en uitzicht zover het oog maar reikt. Een vakantiebestemming waar níets moet en alles mag. De dag stuurt zichzelf bij Wadzout’t.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EMany people experience the same when they arrive at WatZout't. The tendency to automatically take off your watch and turn off your cell phone. The suitcases are packed, checked for the umpteenth time whether you have really forgotten anything. The neighbor takes care of the cat and the plants. The door is locked, and with the car in the direction of the first holiday traffic jam… And out of all the haste and hectic you suddenly arrive at WadZout't. Silence… Fresh air, the sound of the sea and views as far as the eye can see. A holiday destination where nothing has to be done and everything is allowed. The day steers itself at Wadzout't.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EViele Menschen erleben dasselbe, wenn sie bei WatZout't ankommen. Die Tendenz, automatisch die Uhr abzunehmen und das Handy auszuschalten. Die Koffer werden gepackt, zum x-ten Mal kontrolliert, ob man wirklich etwas vergessen hat. Der Nachbar kümmert sich um die Katze und die Pflanzen. Die Tür ist verschlossen, und mit dem Auto Richtung erster Urlaubsstau… Und aus aller Hast und Hektik kommt man plötzlich in WadZout't an. Stille… Frische Luft, Meeresrauschen und Ausblicke so weit das Auge reicht. Ein Urlaubsziel, in dem nichts getan werden muss und alles erlaubt ist. Der Tag steuert sich auf Wadzout't zu.\u003C\u002Fp\u003E",email:"info@wadzoutt.nl",phone:"0227593377",site:"https:\u002F\u002Fwww.wadzoutt.nl\u002F",enabled:a},{id:"62e9720ccb24f8f4fa9997b6",name:"Kleimeer Assurantiën",category:p,coordinates:"52.906924098738884, 4.961308659148384",description:"\u003Cp\u003EKleimeer Assurantiën staat als uw financieel adviseur garant voor een deskundig en onafhankelijk advies in begrijpelijke taal. Zo'n advies geven wij u graag in een persoonlijk gesprek. Maar als uw gids en vraagbaak in een financiële wereld die steeds complexer wordt, willen wij u ook via onze website informeren en bieden wij u interessante feiten en actueel nieuws.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWilt u uw zaken graag online regelen? Ook dat kan. Zo kunt u hier bijvoorbeeld online wijzigingen doorgeven, een offerte opvragen, een schade melden en formulieren downloaden.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EMaar of u uw zaken nu via onze site wilt regelen of liever persoonlijk met ons bespreekt. Kleimeer Assurantiën is u graag van dienst!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EAs your financial advisor, Kleimeer Assurantiën guarantees expert and independent advice in understandable language. We are happy to give you such advice in a personal conversation. But as your guide and source of information in an increasingly complex financial world, we also want to inform you via our website and provide you with interesting facts and current news.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWould you like to arrange your affairs online? That too is possible. For example, you can submit changes online, request a quote, report damage and download forms.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBut whether you want to arrange your affairs via our site or prefer to discuss it with us personally. Kleimeer Assurantiën is happy to be of service!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EAls Ihr Finanzberater garantiert Kleimeer Assurantiën eine fachkundige und unabhängige Beratung in verständlicher Sprache. Gerne beraten wir Sie hierzu in einem persönlichen Gespräch. Als Ihr Wegweiser und Informationsquelle in einer immer komplexer werdenden Finanzwelt wollen wir Sie aber auch über unsere Website informieren und Sie mit Wissenswertem und Aktuellem versorgen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ESie möchten Ihre Angelegenheiten online regeln? Auch das ist möglich. So können Sie beispielsweise online Änderungen einreichen, ein Angebot anfordern, Schäden melden und Formulare herunterladen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAber egal, ob Sie Ihre Angelegenheiten über unsere Seite regeln oder lieber persönlich mit uns besprechen möchten. Kleimeer Assurantiën steht Ihnen gerne zur Verfügung!\u003C\u002Fp\u003E",email:" info@kleimeerassurantien.nl",phone:q,site:"https:\u002F\u002Fwww.kleimeerassurantien.nl\u002F",enabled:a},{id:"62ed74435f7cb94dabf3bbe9",name:"Eeterij Ongder de Kukel - Sjokoolaatje",category:f,coordinates:"52.907663367763, 4.9616928841233",description:"\u003Cp\u003EZodra je hier binnenstapt voel je het meteen... Dit is een plek waar je&nbsp;\u003C\u002Fp\u003E\u003Cp\u003Eje thuis voelt... en zeker nog 'ns terugkomt!\u003C\u002Fp\u003E\u003Cp\u003EOngder de Kukel is heerlijk uitgebreid dineren met familie, vrienden of collega's.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EU bent van harte welkom.\u003C\u002Fp\u003E\u003Cp\u003EDe uitbaters Berber de Lange en Henry Heutink zullen u gastvrij ontvangen in dit sfeervolle restaurant.\u003C\u002Fp\u003E\u003Cp\u003EOok dochter Fonnese en zoon Cliff&nbsp;dragen hun steente bij in dit bourgondische restaurant.\u003C\u002Fp\u003E\u003Cp\u003EFonesse in de bediening en Cliff in de keuken.\u003C\u002Fp\u003E\u003Cp\u003EHenry, neemt de taak van kok op zich, en dat is hem wel toevertrouwd.\u003C\u002Fp\u003E\u003Cp\u003EHenry sleepte diverse prijzen uit de horecabranche in de wacht.\u003C\u002Fp\u003E\u003Cp\u003ERuime ervaring deed hij op als kok bij diverse bedrijven.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EAs soon as you step in here you immediately feel it... This is a place where you\u003C\u002Fp\u003E\u003Cp\u003Eyou feel at home... and will definitely come back!\u003C\u002Fp\u003E\u003Cp\u003EOngder de Kukel is a delicious extensive dinner with family, friends or colleagues.\u003C\u002Fp\u003E\u003Cp\u003EYou're welcome.\u003C\u002Fp\u003E\u003Cp\u003EThe owners Berber de Lange and Henry Heutink will receive you hospitably in this atmospheric restaurant.\u003C\u002Fp\u003E\u003Cp\u003EDaughter Fonnese and son Cliff also contribute to this Burgundian restaurant.\u003C\u002Fp\u003E\u003Cp\u003EFonesse in the waiter and Cliff in the kitchen.\u003C\u002Fp\u003E\u003Cp\u003EHenry, takes the job of cook, and that is entrusted to him.\u003C\u002Fp\u003E\u003Cp\u003EHenry has won several awards from the hospitality industry.\u003C\u002Fp\u003E\u003Cp\u003EHe gained extensive experience as a cook at various companies.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ESobald Sie hier eintreten, spüren Sie es sofort ... Dies ist ein Ort, an dem Sie\u003C\u002Fp\u003E\u003Cp\u003ESie fühlen sich wie zu Hause ... und kommen bestimmt wieder!\u003C\u002Fp\u003E\u003Cp\u003EOngder de Kukel ist ein köstliches ausgedehntes Abendessen mit Familie, Freunden oder Kollegen.\u003C\u002Fp\u003E\u003Cp\u003EGern geschehen.\u003C\u002Fp\u003E\u003Cp\u003EDie Besitzer Berber de Lange und Henry Heutink empfangen Sie gastfreundlich in diesem stimmungsvollen Restaurant.\u003C\u002Fp\u003E\u003Cp\u003ETochter Fonnese und Sohn Cliff tragen ebenfalls zu diesem burgundischen Restaurant bei.\u003C\u002Fp\u003E\u003Cp\u003EFonese im Kellner und Cliff in der Küche.\u003C\u002Fp\u003E\u003Cp\u003EHenry übernimmt den Job des Kochs, und das wird ihm anvertraut.\u003C\u002Fp\u003E\u003Cp\u003EHenry hat mehrere Auszeichnungen aus der Hotellerie gewonnen.\u003C\u002Fp\u003E\u003Cp\u003EUmfangreiche Erfahrungen als Koch sammelte er in verschiedenen Betrieben.\u003C\u002Fp\u003E",phone:"0227593118",site:"http:\u002F\u002Fwww.odk.nl\u002F",enabled:a},{id:"62ed75195f7cb94dabf3bbea",name:"Eeterij & Snackcorner De Smulhoek",category:f,coordinates:"52.90604504990148, 4.960651633605185",description:"\u003Cp\u003EU bent van harte welkom bij restaurant ´t Plein, waarvan de opening 1 juli 2009 heeft plaats gevonden en het ziet er uitnodigend uit. Met een zeer goede prijs \u002F kwaliteit verhouding, zult u bij dit restaurant volop kunnen genieten van u lunch of diner in een sfeervolle ambiance.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ERestaurant ’t Plein is een sfeervol restaurant met een schitterend zonnig terras. Makkelijk te vinden, en een ruim aanbod van gratis parkeerplaatsen voor het restaurant. Ook is er gedacht aan de kinderen met een speciaal kinderspeelhoekje. De mogelijkheid om met de pin te betalen is er ook.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EYou are very welcome at restaurant 't Plein, which opened on July 1, 2009 and it looks inviting. With a very good price \u002F quality ratio, you will be able to fully enjoy your lunch or dinner at this restaurant in an attractive ambiance.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ERestaurant 't Plein is an attractive restaurant with a beautiful sunny terrace. Easy to find, and a wide range of free parking spaces in front of the restaurant. The children have also been thought of with a special children's play corner. There is also the option to pay by card.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ESie sind herzlich willkommen im Restaurant 't Plein, das am 1. Juli 2009 eröffnet wurde und einladend aussieht. Mit einem sehr guten Preis-Leistungs-Verhältnis können Sie Ihr Mittag- oder Abendessen in diesem Restaurant in einem attraktiven Ambiente in vollen Zügen genießen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ERestaurant 't Plein ist ein attraktives Restaurant mit einer schönen sonnigen Terrasse. Leicht zu finden und viele kostenlose Parkplätze vor dem Restaurant. Auch an die Kinder wurde mit einer speziellen Kinderspielecke gedacht. Es besteht auch die Möglichkeit, mit Karte zu bezahlen.\u003C\u002Fp\u003E",email:"info@restauranthetplein.nl",phone:"0227592344",site:"http:\u002F\u002Fwww.restauranthetplein.nl\u002F",enabled:a},{id:"62ed87271a4ec4c5fca3bad1",name:"Café Waddenzee",category:f,logo:e,coordinates:"52.889674360717365, 4.921760385480082",description:"\u003Ch4\u003ERestaurant, terras of afhalen\u003C\u002Fh4\u003E\u003Col\u003E\u003Cli\u003EGevarieerde kaart\u003C\u002Fli\u003E\u003Cli\u003EHeerlijke seizoensgerechten\u003C\u002Fli\u003E\u003Cli\u003ESpeciale dieetwensen? Laat het weten!\u003C\u002Fli\u003E\u003C\u002Fol\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch4\u003EHeeft u iets te vieren?\u003C\u002Fh4\u003E\u003Cp\u003EEen huwelijksfeest, jubileum of verjaardag? Wij verzorgen dit graag voor u.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch4\u003ELeuke activiteiten\u003C\u002Fh4\u003E\u003Cp\u003ECaféspellen, live muziek, biljart, pubquizavonden en nog veel meer gezellige activiteiten!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003ERestaurant, terrace or takeout\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Col\u003E\u003Cli\u003EVaried card\u003C\u002Fli\u003E\u003Cli\u003EDelicious seasonal dishes\u003C\u002Fli\u003E\u003Cli\u003ESpecial dietary requirements? Let me know!\u003C\u002Fli\u003E\u003C\u002Fol\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EDo you have something to celebrate?\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EA wedding party, anniversary or birthday? We are happy to take care of this for you.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EFun activities\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003ECafé games, live music, billiards, pub quiz nights and many more fun activities!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003ERestaurant, Terrasse oder Take Away\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cul\u003E\u003Cli\u003EAbwechslungsreiche Karte\u003C\u002Fli\u003E\u003Cli\u003EKöstliche saisonale Gerichte\u003C\u002Fli\u003E\u003Cli\u003ESpezielle Ernährungsbedürfnisse? Gib mir Bescheid!\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EHaben Sie etwas zu feiern?\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EEine Hochzeitsfeier, ein Jubiläum oder ein Geburtstag? Dies übernehmen wir gerne für Sie.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003ELustige Aktivitäten\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003ECafé-Spiele, Live-Musik, Billard, Pub-Quizabende und viele weitere unterhaltsame Aktivitäten!\u003C\u002Fp\u003E",email:"info@cafe-waddenzee.nl",phone:"0625042538",site:"https:\u002F\u002Fwww.cafe-waddenzee.nl\u002F",enabled:a},{id:"62ee30e3b974cb2998dd10ea",name:"Vidaro IJs en Spijs",category:f,coordinates:"52.90793140047043, 4.963231492170681",description:"\u003Cp\u003EOp onze kaart staan uiteraard diverse smaken, op ambachtelijke wijze gemaakt Italiaans schepijs. Bij Vidaro hebben we de klassieke smaken zoals pistache, aardbeien, vanille, hazelnoot, chocolade, citroen, rum-rozijnen, kokosnoot of banaan. Daarnaast hebben we de wisselende, speciale smaken zoals stroopwafel, oma’s appeltaart, bitterkoekjes, Oreo en nog veel meer! Onze smaken wisselen, zodat er altijd wel voor iedereen een favoriet tussen zit. Uiteraard staan wij open voor suggesties en zien deze altijd graag teruggekoppeld in een leuk bericht!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ENaast ons heerlijke schepijs verkopen wij ook heerlijke koffie, lekkernijen en diverse andere spijzen. Ons team van professionals maakt namelijk met veel liefde en zorg onder andere ook heerlijk vers belegde broodjes voor u. Ons heerlijk assortiment broodjes en beleg worden aangeleverd door onze lokale partners. Kortom beter is er niet, en zo steunen wij onze ondernemers uit de Wieringen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ENaast afhalen, heeft Vidaro ijs en spijs ook een bezorgservice. Voor de voorwaarden omtrent deze bezorgservice verwijzen we u naar het besteloverzicht. Wij zijn zeven dagen per week geopend. De vers belegde broodjes kunnen uiteraard naast bezorgen ook worden afgehaald op ons filiaal op de Parklaan 1a in Hippolytushoef. IJs en koffie kunnen daarentegen uitsluitend worden afgehaald bij onze vestiging.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EOur menu includes various flavors of Italian ice cream made in an artisanal way. At Vidaro we have the classic flavors such as pistachio, strawberry, vanilla, hazelnut, chocolate, lemon, rum-raisin, coconut or banana. In addition, we have the changing, special flavors such as stroopwafel, grandma's apple pie, macaroons, Oreo and much more! Our flavors vary, so there is always a favorite for everyone. Of course we are open to suggestions and always like to see them fed back in a nice message!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIn addition to our delicious ice cream, we also sell delicious coffee, delicacies and various other foods. Our team of professionals makes delicious freshly filled sandwiches for you with a lot of love and care. Our delicious range of sandwiches and spreads are supplied by our local partners. In short, there is nothing better, and this is how we support our entrepreneurs from the Wieringen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIn addition to takeout, Vidaro also has a delivery service for ice cream and food. For the conditions regarding this delivery service, we refer you to the order overview. We are open seven days a week. In addition to delivery, the freshly filled sandwiches can of course also be picked up at our branch at Parklaan 1a in Hippolytushoef. Ice cream and coffee, on the other hand, can only be picked up at our location.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnsere Speisekarte umfasst verschiedene Aromen von italienischem Eis, das auf handwerkliche Weise hergestellt wird. Bei Vidaro haben wir die klassischen Geschmacksrichtungen wie Pistazie, Erdbeere, Vanille, Haselnuss, Schokolade, Zitrone, Rum-Rosinen, Kokosnuss oder Banane. Außerdem haben wir die wechselnden, besonderen Geschmacksrichtungen wie Stroopwafel, Omas Apfelkuchen, Makronen, Oreo und vieles mehr! Unsere Geschmacksrichtungen variieren, sodass es immer einen Favoriten für jeden gibt. Natürlich sind wir offen für Vorschläge und freuen uns immer, wenn diese in einer netten Nachricht zurückgemeldet werden!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ENeben unserem leckeren Eis verkaufen wir auch leckeren Kaffee, Leckereien und diverse andere Lebensmittel. Unser professionelles Team bereitet mit viel Liebe und Sorgfalt auch köstliche, frisch belegte Sandwiches für Sie zu. Unser köstliches Angebot an Sandwiches und Aufstrichen wird von unseren Partnern vor Ort geliefert. Kurz gesagt, es gibt nichts Besseres und so unterstützen wir unsere Unternehmer aus den Wieringen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ENeben Speisen zum Mitnehmen bietet Vidaro auch einen Lieferservice für Eis und Lebensmittel an. Für die Bedingungen zu diesem Lieferservice verweisen wir auf die Bestellübersicht. Wir haben sieben Tage die Woche geöffnet. Neben der Lieferung können die frisch gefüllten Sandwiches natürlich auch in unserer Filiale in der Parklaan 1a in Hippolytushoef abgeholt werden. Eis und Kaffee hingegen können nur bei uns vor Ort abgeholt werden.\u003C\u002Fp\u003E",email:"info@vidaro-ijs.nl",phone:"0621820878",site:"http:\u002F\u002Fwww.vidaro-ijs.nl\u002F",enabled:a},{id:"62ee31a1b974cb2998dd10eb",name:"Restaurant Bruisend",category:f,coordinates:"52.93620007849197, 5.032278204766622",description:"\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EIn het hartje van Den Oever schittert restaurant Bruisend.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EGeniet van puur eten, bijzondere gerechten en de lekkerste wijnen op ons&nbsp;zonovergoten terras of in ons gemoedelijke restaurant.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EOnze grote passie voor eten en drinken dragen wij graag op je over.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EWij serveren eten wat je gelukkig en blij maakt.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EAuthentieke recepten uit alle uithoeken van de wereld.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003ESoms traditioneel, vaker nog vermengd met invloeden uit andere continenten.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EAltijd aangepast met een onsje extra liefde en een snufje eigenwijsheid.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EOf we het nu Wereldkeuken, Soulfood of New American noemen.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EEén ding hebben alle gerechten op onze kaart gemeen. Je wordt er blij van!\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003E​\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EKleine geluksmomentjes die al je zintuigen prikkelen.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: transparent;\"\u003EVier het leven!\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EIn the heart of Den Oever, restaurant Bruisend shines.\u003C\u002Fp\u003E\u003Cp\u003EEnjoy pure food, special dishes and the tastiest wines on our sun-drenched terrace or in our cozy restaurant.\u003C\u002Fp\u003E\u003Cp\u003EWe are happy to pass on our great passion for food and drink to you.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe serve food that makes you happy and happy.\u003C\u002Fp\u003E\u003Cp\u003EAuthentic recipes from all over the world.\u003C\u002Fp\u003E\u003Cp\u003ESometimes traditional, more often mixed with influences from other continents.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlways adapted with an ounce of extra love and a pinch of stubbornness.\u003C\u002Fp\u003E\u003Cp\u003EWhether we call it World Cuisine, Soul Food or New American.\u003C\u002Fp\u003E\u003Cp\u003EAll dishes on our menu have one thing in common. It makes you happy!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E​Little moments of happiness that stimulate all your senses.\u003C\u002Fp\u003E\u003Cp\u003ECelebrate life!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EIm Herzen von Den Oever glänzt das Restaurant Bruisend.\u003C\u002Fp\u003E\u003Cp\u003EGenießen Sie pure Kost, besondere Gerichte und die leckersten Weine auf unserer sonnenverwöhnten Terrasse oder in unserem gemütlichen Restaurant.\u003C\u002Fp\u003E\u003Cp\u003EUnsere große Leidenschaft für Essen und Trinken geben wir gerne an Sie weiter.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir servieren Speisen, die glücklich und glücklich machen.\u003C\u002Fp\u003E\u003Cp\u003EAuthentische Rezepte aus aller Welt.\u003C\u002Fp\u003E\u003Cp\u003EMal traditionell, öfter gemischt mit Einflüssen aus anderen Kontinenten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EImmer angepasst mit einer Unze extra Liebe und einer Prise Sturheit.\u003C\u002Fp\u003E\u003Cp\u003EOb wir es World Cuisine, Soul Food oder New American nennen.\u003C\u002Fp\u003E\u003Cp\u003EAlle Gerichte auf unserer Speisekarte haben eines gemeinsam. Es macht glücklich!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E​Kleine Glücksmomente, die alle Sinne anregen.\u003C\u002Fp\u003E\u003Cp\u003EDas Leben feiern!\u003C\u002Fp\u003E",email:"welkom@restaurantbruisend.nl",phone:"0227511405",site:"http:\u002F\u002Fwww.restaurantbruisend.nl\u002F",enabled:a},{id:"62ee3256b974cb2998dd10ec",name:"Viscentre 't Wad",category:f,coordinates:"52.93429606707668, 5.035874911325877",description:"\u003Cp\u003E\u003Cstrong\u003EDe lekkerste vis in Den Oever\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAan het begin van de Afsluitdijk in Den Oever vind je Viscentre ’t Wad. Een visrestaurant waar je de lekkerste vis kunt eten. Vanuit ons restaurant kijk je uit op de levendige haven met vissersboten. En wie geluk heeft ziet achter de dijk op de Oeverse Schor een zeehond liggen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EVerrassend visrestaurant\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWaar de beste kwaliteit vis wordt geserveerd, moet ook een restaurant staan die dezelfde kwaliteit uitstraalt. ’t Wad kan dan ook gerust een verrassend visrestaurant worden genoemd. Open, robuust en stoer past het in de omgeving van vissers en de havens en doet het recht aan de verse vis en heerlijke visgerechten die hier worden geserveerd.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EVoor vissers tot vertegenwoordigers\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre ’t Wad is dagelijks geopend voor iedereen. Van de vissers uit de haven in werkkleding tot vertegenwoordigers in strak kostuum, iedereen is hier welkom en iedereen komt hier ook steeds weer terug. Niet alleen uit Den Oever en de Wieringermeer maar uit heel het land komen de gasten naar ’t Wad om een visje te eten. Kwaliteit is immers voor iedereen, en onze vis voldoet daar elke keer weer aan.\u003C\u002Fp\u003E\u003Ch2\u003E\u003Cbr\u003E\u003C\u002Fh2\u003E\u003Cp\u003E\u003Cstrong\u003EVerse vis, ook om mee te nemen\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EMet voormalige vissers aan het roer van dit visrestaurant is de kwaliteit elke dag weer gewaarborgd. Elke dag wordt de vis op de visafslag ingekocht en verwerkt tot eerlijke verse visgerechten om bij ’t Wad zelf op te eten of mee te nemen voor thuis.\u003C\u002Fp\u003E\u003Ch2\u003E\u003Cbr\u003E\u003C\u002Fh2\u003E\u003Cp\u003E\u003Cstrong\u003EViscentre ’t Wad, dagelijks geopend\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre ’t Wad in Den Oever is dagelijks geopend vanaf 11 uur. Wie een dagje uit gaat in Den Oever, naar de Waddenzee of richting de Afsluitdijk rijdt is meer dan welkom om bij ons een lekker visje te komen eten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EThe best fish in Den Oever\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAt the beginning of the Afsluitdijk in Den Oever you will find Viscentre 't Wad. A fish restaurant where you can eat the tastiest fish. From our restaurant you overlook the lively harbor with fishing boats. And if you're lucky, you'll see a seal behind the dike on the Oeverse Schor.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003ESurprising fish restaurant\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWhere the best quality fish is served, there must also be a restaurant that radiates the same quality. 't Wad can therefore safely be called a surprising fish restaurant. Open, robust and sturdy, it fits into the environment of fishermen and the ports and does justice to the fresh fish and delicious fish dishes that are served here.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EFor fishermen to representatives\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre 't Wad is open daily to everyone. From the fishermen from the harbor in work clothes to representatives in smart suits, everyone is welcome here and everyone comes back again and again. Not only from Den Oever and Wieringermeer, but from all over the country, guests come to 't Wad to eat fish. After all, quality is for everyone, and our fish meets this every time.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EFresh fish, also to take away\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWith former fishermen at the helm of this seafood restaurant, the quality is guaranteed every day. Every day the fish is purchased at the fish auction and processed into honest fresh fish dishes to eat at 't Wad itself or to take home.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EViscentre 't Wad, open daily\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre 't Wad in Den Oever is open daily from 11 am. Whoever goes out for a day in Den Oever, to the Wadden Sea or drives towards the Afsluitdijk is more than welcome to come and eat a nice fish with us.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EDer beste Fisch in Den Oever\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAm Anfang des Afsluitdijk in Den Oever finden Sie Viscentre 't Wad. Ein Fischrestaurant, in dem Sie den leckersten Fisch essen können. Von unserem Restaurant überblicken Sie den lebhaften Hafen mit Fischerbooten. Und wenn Sie Glück haben, sehen Sie hinter dem Deich auf der Oeverse Schor eine Robbe.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EÜberraschendes Fischrestaurant\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWo die beste Fischqualität serviert wird, muss es auch ein Restaurant geben, das die gleiche Qualität ausstrahlt. 't Wad kann daher getrost als überraschendes Fischrestaurant bezeichnet werden. Offen, robust und robust fügt es sich in das Umfeld von Fischern und Häfen ein und wird dem frischen Fisch und den köstlichen Fischgerichten, die hier serviert werden, gerecht.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EFür Fischer zu Vertretern\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre 't Wad ist täglich für alle geöffnet. Vom Fischer vom Hafen in Arbeitskleidung bis zum Vertreter im schicken Anzug ist hier jeder willkommen und jeder kommt immer wieder. Nicht nur aus Den Oever und dem Wieringermeer, sondern aus dem ganzen Land kommen Gäste nach 't Wad, um Fisch zu essen. Qualität ist schließlich für alle da und unser Fisch erfüllt sie jedes Mal.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EFrischer Fisch, auch zum Mitnehmen\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EMit ehemaligen Fischern an der Spitze dieses Fischrestaurants wird die Qualität jeden Tag garantiert. Jeden Tag wird der Fisch auf der Fischauktion gekauft und zu ehrlichen, frischen Fischgerichten verarbeitet, die Sie bei 't Wad selbst essen oder mit nach Hause nehmen können.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EViscentre 't Wad, täglich geöffnet\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EViscentre 't Wad in Den Oever ist täglich ab 11 Uhr geöffnet. Wer einen Tag in Den Oever, ans Wattenmeer oder in Richtung Afsluitdijk fährt, ist herzlich eingeladen, bei uns einen guten Fisch zu essen.\u003C\u002Fp\u003E",email:"info@viscentrehetwad.nl",phone:"0227510405",site:"https:\u002F\u002Fviscentrehetwad.nl\u002F",enabled:a},{id:"62ee32ccb974cb2998dd10ed",name:"Café Arlette",category:f,coordinates:"52.90824827358817, 4.96183900492745",description:"\u003Cp\u003EEen gezellig café in het mooie Hippolytushoef, voor jong &amp; oud, voor een borrel of een feestje. Wees welkom!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EA cozy café in the beautiful Hippolytushoef, for young and old, for a drink or a party. Be welcome!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EEin gemütliches Café im schönen Hippolytushoef, für Jung und Alt, für einen Drink oder eine Party. Sei willkommen!\u003C\u002Fp\u003E",email:"cafearlette@outlook.com",site:"https:\u002F\u002Fm.facebook.com\u002Fcafearlettehippo\u002F",enabled:a},{id:"62ee33a6b974cb2998dd10ee",name:"Bakkerij Dunselman",category:d,coordinates:"52.90698315978778, 4.961375172715638",description:"\u003Cp\u003E\u003Cstrong\u003EWij bakken voor jou!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EEn dat doen we al 160 jaar bij Bakkerij Dunselman. Vanaf de oprichting van ons familiebedrijf, tot en met de laatste ontwikkelingen nu: die slogan blijft op ons van toepassing. Lekkere producten zijn namelijk altijd de basis geweest van ons bestaansrecht.\u003C\u002Fp\u003E\u003Cp\u003EOnze heerlijke broden, de smaakvolle taarten en gebakjes en de lekkere koekjes. Iedere dag weer staan ze bij duizenden mensen, die er dagelijks van genieten. Dat kan mede dankzij onze vele winkels in alle wijken in Den Helder en Julianadorp. De bereikbaarheid voor klanten is daardoor optimaal.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWe bake for you!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAnd we have been doing this for 160 years at Bakery Dunselman. From the foundation of our family business, up to and including the latest developments: that slogan continues to apply to us. Tasty products have always been the basis of our existence.\u003C\u002Fp\u003E\u003Cp\u003EOur delicious breads, the tasteful cakes and pastries and the delicious cookies. Every day they are with thousands of people, who enjoy them every day. This is possible thanks to our many shops in all neighborhoods in Den Helder and Julianadorp. The accessibility for customers is therefore optimal.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWir backen für Sie!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EUnd das tun wir bei Bakery Dunselman seit 160 Jahren. Von der Gründung unseres Familienunternehmens bis hin zu den neuesten Entwicklungen: Dieser Slogan gilt bis heute für uns. Schmackhafte Produkte sind seit jeher die Grundlage unserer Existenz.\u003C\u002Fp\u003E\u003Cp\u003EUnsere leckeren Brote, die geschmackvollen Kuchen und Backwaren und die leckeren Plätzchen. Jeden Tag sind sie bei Tausenden von Menschen, die sich jeden Tag daran erfreuen. Dies ist dank unserer vielen Geschäfte in allen Stadtteilen von Den Helder und Julianadorp möglich. Die Erreichbarkeit für Kunden ist somit optimal.\u003C\u002Fp\u003E",phone:"0227591594",site:"http:\u002F\u002Fwww.bakkerijdunselman.nl\u002F",enabled:a},{id:"62ee3485b974cb2998dd10ef",name:"Bloemennis",category:d,coordinates:"52.906392221243735, 4.96108639610119",description:"\u003Cp\u003E\u003Cstrong\u003EWELKOM BIJ BLOEMENNIS, DE MOOISTE BLOEMEN EN PLANTEN!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EMidden in het hart van Hippolytushoef is onze knusse bloemenwinkel Bloemennis gevestigd.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij bezorgen op heel Wieringen en in de Wieringermeer. Doordat wij zijn aangesloten bij de organisatie “Webbloemen” is bezorgen overal in Nederland mogelijk, en vaak ook daar buiten.\u003C\u002Fp\u003E\u003Cp\u003EWij houden van persoonlijke aandacht, gezelligheid en creativiteit en staan open voor alle vragen en wensen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWELCOME TO BLOEMENNIS, THE MOST BEAUTIFUL FLOWERS AND PLANTS!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EOur cozy flower shop Bloemennis is located right in the heart of Hippolytushoef.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe deliver throughout Wieringen and in the Wieringermeer. Because we are affiliated with the organization \"Webbloemen\" delivery is possible everywhere in the Netherlands, and often also outside.\u003C\u002Fp\u003E\u003Cp\u003EWe love personal attention, conviviality and creativity and are open to all questions and wishes.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWILLKOMMEN BEI BLOEMENNIS, DEN SCHÖNSTEN BLUMEN UND PFLANZEN!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EUnser gemütliches Blumengeschäft Bloemennis befindet sich direkt im Herzen von Hippolytushoef.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir liefern in ganz Wieringen und im Wieringermeer. Da wir der Organisation \"Webbloemen\" angeschlossen sind, ist eine Lieferung überall in den Niederlanden und oft auch außerhalb möglich.\u003C\u002Fp\u003E\u003Cp\u003EWir lieben persönliche Betreuung, Geselligkeit und Kreativität und sind offen für alle Fragen und Wünsche.\u003C\u002Fp\u003E",email:"info@bloemennis.nl",phone:"0628526978",site:"http:\u002F\u002Fwww.bloemennis.nl\u002F",enabled:a},{id:"62ee353bb974cb2998dd10f0",name:"Bocado Kaas & Delicatessen",category:d,coordinates:"52.90588225942224, 4.960814744076642",description:"\u003Cp\u003EBocado kaas en delicatessen: hét adres in Noord-Holland voor echte fijnproevers.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EWij staan voor puur, verfijnd en verantwoord. Onze producten zijn met smaak en aandacht geselecteerd. Vanuit liefde en passie voor eten.\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EBocado is ook uw kaasspecialist!\u003C\u002Fp\u003E\u003Cp\u003EBij ons kunt u terecht voor een groot assortiment Hollandse- en buitenlandse kaas. De Noord Hollandse kazen zijn o.a. van het merk SmaaQ. Noord-Hollandse kaas is zeer bekend bij de consument, het staat synoniem voor kwaliteit en een heerlijke smaak: SmaaQ met de Q van Qualiteit. SmaaQ is in samenwerking met CONO Kaasmakers exclusief voor de Kaasspeciaalzaken ontwikkeld.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EOok hebben we altijd een mooi assortiment Boeren kazen op de plank liggen. Boeren kazen zijn gemaakt van rauwe melk en daardoor heerlijk vol en romig van smaak.\u003C\u002Fp\u003E\u003Cp\u003EBuitenlandse kazen, rechtstreeks geïmporteerd van de producent. Halfgare kaas, blauw-geaderde kaas, gewassen roodkorst, witte korstkaas en verse roomkazen. Er zijn kazen uit o.a. Frankrijk, Belgie, Duitsland, Spanje, Italie en Zwitserland. Kom het gehele assortiment bekijken en proeven in onze winkel!\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EBocado cheese and delicacies: the address in North Holland for true gourmets.\u003C\u002Fp\u003E\u003Cp\u003EWe stand for pure, refined and responsible. Our products are selected with taste and attention. Out of love and passion for food.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBocado is also your cheese specialist!\u003C\u002Fp\u003E\u003Cp\u003EYou can come to us for a wide range of Dutch and foreign cheese. The North Holland cheeses are, among others, of the SmaaQ brand. North Holland cheese is well known to consumers, it is synonymous with quality and a delicious taste: SmaaQ with the Q for Quality. SmaaQ was developed in collaboration with CONO Kaasmakers exclusively for the cheese specialty shops.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe also always have a nice range of Farmer's cheeses on the shelf. Farmers cheeses are made from raw milk and therefore have a wonderfully full and creamy taste.\u003C\u002Fp\u003E\u003Cp\u003EForeign cheeses, imported directly from the producer. Semi-cooked cheese, blue-veined cheese, washed red rind, white rind cheese and fresh cream cheeses. There are cheeses from France, Belgium, Germany, Spain, Italy and Switzerland. Come see and taste the entire range in our store!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EBocado-Käse und Delikatessen: die Adresse in Nordholland für echte Feinschmecker.\u003C\u002Fp\u003E\u003Cp\u003EWir stehen für pur, raffiniert und verantwortungsbewusst. Unsere Produkte werden mit Geschmack und Aufmerksamkeit ausgewählt. Aus Liebe und Leidenschaft zum Essen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBocado ist auch Ihr Käsespezialist!\u003C\u002Fp\u003E\u003Cp\u003EBei uns finden Sie eine große Auswahl an niederländischem und ausländischem Käse. Die nordholländischen Käsesorten sind unter anderem von der Marke SmaaQ. Nordholländischer Käse ist dem Verbraucher ein Begriff, er steht für Qualität und einen köstlichen Geschmack: SmaaQ mit dem Q für Qualität. SmaaQ wurde in Zusammenarbeit mit CONO Kaasmakers exklusiv für den Käsefachhandel entwickelt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAußerdem haben wir immer eine schöne Auswahl an Bauernkäse im Regal. Bauernkäse werden aus Rohmilch hergestellt und haben daher einen wunderbar vollen und cremigen Geschmack.\u003C\u002Fp\u003E\u003Cp\u003EAusländische Käsesorten, direkt vom Erzeuger importiert. Halbgekochter Käse, Blauschimmelkäse, gewaschener Rotschimmelkäse, Weißschimmelkäse und Frischkäse. Es gibt Käse aus Frankreich, Belgien, Deutschland, Spanien, Italien und der Schweiz. Kommen Sie und probieren Sie das gesamte Sortiment in unserem Geschäft!\u003C\u002Fp\u003E",email:"​info@bocado.nl",phone:"0655521877",site:"http:\u002F\u002Fwww.bocado.nl\u002F",enabled:a},{id:"62ee359fb974cb2998dd10f1",name:"DekaMarkt Hippolytushoef",category:d,coordinates:"52.9060398654454, 4.960974167731249",description:"\u003Cp\u003EDirk Kat opent in 1941 een kruidenierszaak. Hij opent in 1949 onder de naam Kijkgrijp in Velsen-Noord zijn eerste zelfbedieningswinkel. Het familiebedrijf DekaMarkt heeft 99 winkels in de provincies Noord- en Zuid-Holland, Gelderland, Overijssel, Utrecht en Flevoland. Ook hebben we een bezorgservice (online boodschappen doen).&nbsp;De supermarktketen is sinds 1 januari 2009 onderdeel van Detailresult Groep N.V. Detailresult Groep N.V heeft behalve diverse supermarktformules ook eigen productiebedrijven, diverse distributiecentra, verscentrales en transport. Tot slot zijn er aan het bedrijf gelieerde tuincentra en slijterijen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EDirk Kat opens a grocery store in 1941. In 1949, he opened his first self-service store under the name Kijk Grip in Velsen-Noord. The family business DekaMarkt has 99 stores in the provinces of North and South Holland, Gelderland, Overijssel, Utrecht and Flevoland. We also have a delivery service (online shopping). The supermarket chain has been part of Detailresult Groep N.V. since 1 January 2009. In addition to various supermarket formulas, Detailresult Groep N.V also has its own production companies, various distribution centers, fresh produce centers and transport. Finally, there are garden centers and liquor stores affiliated with the company.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDirk Kat eröffnet 1941 ein Lebensmittelgeschäft. 1949 eröffnete er sein erstes Selbstbedienungsgeschäft unter dem Namen Kijk Grip in Velsen-Noord. Das Familienunternehmen DekaMarkt hat 99 Filialen in den Provinzen Nord- und Südholland, Gelderland, Overijssel, Utrecht und Flevoland. Wir haben auch einen Lieferservice (Online-Shopping). Die Supermarktkette gehört seit dem 1. Januar 2009 zur Detailresult Groep N.V. Neben verschiedenen Supermarktformeln verfügt die Detailresult Groep N.V auch über eigene Produktionsbetriebe, verschiedene Vertriebszentren, Frischwarenzentren und Transport. Schließlich gibt es Gartencenter und Spirituosengeschäfte, die dem Unternehmen angeschlossen sind.\u003C\u002Fp\u003E",phone:"0883135385",site:"https:\u002F\u002Fwww.dekamarkt.nl\u002F",enabled:a},{id:"62ee3638b974cb2998dd10f2",name:"Embrace Damesmode",category:d,coordinates:"52.906727828251626, 4.961237650343475",description:"\u003Cp\u003EJouw mode avontuur begint hier!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EYour fashion adventure starts here!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDein Fashion-Abenteuer beginnt hier!\u003C\u002Fp\u003E",email:"hippolytushoef@embrace.nl",phone:"0227591237",site:"http:\u002F\u002Fwww.embrace.nl\u002F",enabled:a},{id:"62ee3700b974cb2998dd10f3",name:"Etos Koops Drogisterij",category:d,coordinates:"52.907218343946035, 4.961457522475183",description:"\u003Cp\u003EEtos is al meer dan honderd jaar jouw vertrouwde drogist. In de winkel én online. Met ruim 550 filialen door heel Nederland is er altijd een Etos drogist bij jou in de buurt. Wat je vraag ook is, we helpen je verder.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEtos has been your trusted drugstore for over a hundred years. In-store and online. With more than 550 branches throughout the Netherlands, there is always an Etos drugstore near you. Whatever your question is, we'll help you.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EEtos ist seit über hundert Jahren die Drogerie Ihres Vertrauens. Im Geschäft und online. Mit mehr als 550 Filialen in den Niederlanden ist immer eine Etos-Apotheke in Ihrer Nähe. Was auch immer Ihre Frage ist, wir helfen Ihnen.\u003C\u002Fp\u003E",phone:"0227593100",site:"https:\u002F\u002Fwww.etos.nl",enabled:a},{id:"62ee376eb974cb2998dd10f4",name:"Kater Funsport",category:d,coordinates:"52.901941515076864, 4.953470032950141",description:"\u003Cp\u003EKATER FUNSPORT is zowel in de zomer als in de winter de place to be. Met ruim 35 jaren ervaring en een totaal winkeloppervlak van meer dan 3500m2 : funshoppen voor het hele gezin! Specialist in windsurfen, kitesurfen, stand up paddle en waterwear. Skiën, snowboarden en wintersportkleding. Een enorm aanbod fashion : trendy, outdoor en sportief. Professionele webshop. Uitstekende service. De coolste deals.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EKATER FUNSPORT is the place to be in both summer and winter. With over 35 years of experience and a total retail area of ​​more than 3500m2, fun shopping for the whole family! Specialist in windsurfing, kitesurfing, stand up paddle and waterwear. Skiing, snowboarding and winter sportswear. A huge range of fashion: trendy, outdoor and sporty. Professional webshop. Outstanding service. The coolest deals.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EKATER FUNSPORT ist der Place to be im Sommer wie im Winter. Mit über 35 Jahren Erfahrung und einer Gesamtverkaufsfläche von mehr als 3500 m2 macht das Einkaufen Spaß für die ganze Familie! Spezialist für Windsurfen, Kitesurfen, Stand Up Paddle und Waterwear. Skifahren, Snowboarden und Wintersportbekleidung. Eine riesige Auswahl an Mode: trendig, outdoor und sportlich. Professioneller Webshop. Hervorragenden Service. Die coolsten Angebote.\u003C\u002Fp\u003E",email:"webshop@kater.nl",phone:"0227593888",site:"https:\u002F\u002Fwww.kater.nl\u002F",enabled:a},{id:"62ee37d6b974cb2998dd10f5",name:"Kringloopwinkel Twice",category:d,coordinates:"52.903332200500145, 4.9509608090203425",description:"\u003Cp\u003ELaten we ons rijk voelen en bedachtzaam en zorgvuldig omgaan met elkaar, onze spullen en onze natuur.\u003C\u002Fp\u003E\u003Cp\u003EWees wijs en kom naar Twice!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ELet's feel rich and be thoughtful and careful with each other, our stuff and our nature.\u003C\u002Fp\u003E\u003Cp\u003EBe wise and come to Twice!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ELasst uns uns reich fühlen und rücksichtsvoll und achtsam miteinander, mit unseren Sachen und unserer Natur umgehen.\u003C\u002Fp\u003E\u003Cp\u003ESei weise und komm zu Twice!\u003C\u002Fp\u003E",email:"info@kringloopwinkeltwice.nl",phone:"0625476676",site:"https:\u002F\u002Fwww.kringloopwinkeltwice.nl\u002F",enabled:a},{id:"62ee387fb974cb2998dd10f6",name:"Detectiespecialist D.J. Laan",category:d,coordinates:"52.905759658794544, 4.96111332934346",description:"\u003Cp\u003EDetectiespecialist D.J. Laan in Hippolytushoef biedt een compleet assortiment detectieapparatuur aan voor archeologen en hobbyisten, grondverzet en beveiliging.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EDetection specialist D.J. Laan in Hippolytushoef offers a complete range of detection equipment for archaeologists and hobbyists, earthmoving and security.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDetektionsspezialist D.J. Laan in Hippolytushoef bietet ein komplettes Sortiment an Ortungsgeräten für Archäologen und Bastler, Erdbewegung und Sicherheit.\u003C\u002Fp\u003E",email:"info@djlaan.nl",phone:"0227593286",site:"https:\u002F\u002Fwww.djlaan.nl\u002F",enabled:a},{id:"62ee3939b974cb2998dd10f7",name:"MotoPort",category:d,coordinates:"52.90151649584449, 4.951507378378129",description:"\u003Cp\u003EMotorrijden is zoveel meer dan opstappen en wegrijden. Het is een samenspel van techniek en stijl, snelheid en geluid, adrenaline en beheersing, knietje aan de grond en stug kilometervreten, woon-werk en puur avontuur. Wat voor motorrijder je ook bent, MotoPort wil voor jou het startpunt zijn van elke veilige rit. Met een motor waar je je één mee voelt, met een helm en kleding die als gegoten zitten en de zekerheid dat het onderhoud tot op de newtonmeter goed zit. Dát is waar MotoPort voor staat. Daarom hebben we méér in huis voor elke motorrijder. Méér&nbsp;nieuwe&nbsp;en&nbsp;gebruikte&nbsp;motoren en scooters. Méér&nbsp;helmen&nbsp;en&nbsp;kleding. Méér&nbsp;accessoires&nbsp;om het maximale uit elke rit te halen. Méér technische kennis van jouw motor. En méér advies,&nbsp;service&nbsp;en inspiratie om jouw leven als motorrijder compleet te maken, zodat je vol vertrouwen kunt opstappen en wegrijden.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ERiding a motorcycle is so much more than getting on and riding off. It is an interplay of technique and style, speed and sound, adrenaline and control, knee to the ground and stiff miles, commuting and pure adventure. Whatever kind of motorcyclist you are, MotoPort wants to be the starting point for every safe ride for you. With an engine that you feel at one with, with a helmet and clothing that fit like a glove and the certainty that maintenance is right down to the newton meter. That is what MotoPort stands for. That is why we have more to offer for every motorcyclist. More new and used motorcycles and scooters. More helmets and clothing. More accessories to get the most out of every ride. More technical knowledge of your engine. And more advice, service and inspiration to make your life as a motorcyclist complete, so that you can get on and drive off with confidence.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMotorradfahren ist so viel mehr als auf- und abfahren. Es ist ein Zusammenspiel von Technik und Stil, Geschwindigkeit und Sound, Adrenalin und Kontrolle, Knie auf dem Boden und steife Meilen, Pendeln und pures Abenteuer. Welche Art von Motorradfahrer Sie auch sind, MotoPort möchte für Sie der Ausgangspunkt für jede sichere Fahrt sein. Mit einem Motor, mit dem man sich wohlfühlt, mit Helm und Kleidung, die wie angegossen sitzen, und der Gewissheit, dass die Wartung auf den Newtonmeter genau ist. Dafür steht MotoPort. Deshalb haben wir für jeden Motorradfahrer mehr zu bieten. Mehr neue und gebrauchte Motorräder und Roller. Mehr Helme und Kleidung. Mehr Zubehör, um das Beste aus jeder Fahrt herauszuholen. Mehr technisches Wissen über Ihren Motor. Und noch mehr Beratung, Service und Inspiration, um Ihr Leben als Motorradfahrer komplett zu machen, damit Sie selbstbewusst aufsteigen und losfahren können.\u003C\u002Fp\u003E",phone:"0227591639",site:"http:\u002F\u002Fwww.motoport.nl\u002Fhippolytushoef",enabled:a},{id:"62ee3a36b974cb2998dd10f8",name:"Slagerij Piet Ottens",category:d,coordinates:"52.90602812116871, 4.961034095918859",description:"\u003Cp\u003E\u003Cstrong\u003EWelkom bij Uw Slager Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij zijn de specialist op het gebied van vers vlees! Ons rundvlees komt rechtstreeks van de boerderij waar de runderen in alle rust opgroeien op de grazige Wieringerweide. Maar ook voor lekkere specialiteiten uit onze eigen worstmakerij kunt u terecht, de grill draait iedere dag!\u003C\u002Fp\u003E\u003Cp\u003EOp deze site willen wij u graag een indruk geven van onze specialiteiten en u laten zien waar en hoe al dat lekkers gemaakt wordt. Heeft u inmiddels trek gekregen? Kom dan eens kijken in onze winkel.\u003C\u002Fp\u003E\u003Cp\u003EMet vriendelijke groet,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; medewerkers\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EAlles voor de lekkerste barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBij Uw Slager Piet Ottens is er volop keuze uit verschillende soorten barbecue menu's en pakketten!&nbsp;Kijk gerust ook eens bij ons assortiment salades, onze losse BBQ producten of onze BBQ specialiteiten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWelcome to Your Butcher Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe are the specialist in the field of fresh meat! Our beef comes directly from the farm where the cattle grow up in peace on the grassy Wieringerweide. But you can also enjoy tasty specialties from our own sausage factory, the grill is running every day!\u003C\u002Fp\u003E\u003Cp\u003EOn this site we would like to give you an impression of our specialties and show you where and how all those goodies are made. Have you gotten hungry by now? Then come and have a look in our store.\u003C\u002Fp\u003E\u003Cp\u003ESincerely,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; employees\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EEverything for the tastiest barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAt Uw Slager Piet Ottens there is plenty of choice from different types of barbecue menus and packages! Feel free to take a look at our range of salads, our individual BBQ products or our BBQ specialties.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWillkommen bei Ihrem Metzger Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir sind der Spezialist im Bereich Frischfleisch! Unser Rindfleisch kommt direkt vom Hof, wo die Rinder in Ruhe auf der grasbewachsenen Wieringerweide aufwachsen. Aber auch leckere Spezialitäten aus unserer hauseigenen Wurstmanufaktur können Sie genießen, der Grill läuft täglich!\u003C\u002Fp\u003E\u003Cp\u003EAuf dieser Seite möchten wir Ihnen einen Eindruck unserer Spezialitäten vermitteln und Ihnen zeigen, wo und wie all diese Leckereien hergestellt werden. Bist du inzwischen hungrig geworden? Dann schauen Sie doch mal in unserem Shop vorbei.\u003C\u002Fp\u003E\u003Cp\u003EAufrichtig,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; Mitarbeiter\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EAlles für das leckerste Barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBei Uw Slager Piet Ottens gibt es eine große Auswahl an verschiedenen Arten von Grillmenüs und -paketen! Werfen Sie gerne einen Blick in unser Salatsortiment, unsere individuellen BBQ-Produkte oder unsere BBQ-Spezialitäten.\u003C\u002Fp\u003E",email:"info@ottens.uw-slager.nl",phone:"0227591269",site:"http:\u002F\u002Fwww.slagerijottens.nl\u002F",enabled:a},{id:"62ee3ab6b974cb2998dd10f9",name:"Praxis Bouwmarkt",category:d,coordinates:"52.90038094907517, 4.948395622534181",description:"\u003Ch4\u003EDoe-het-zelf bouwmarkt Hippolytushoef\u003C\u002Fh4\u003E\u003Cp\u003EPraxis is dé bouwmarkt in Hippolytushoef waar je naar toe kunt voor al je doe-het-zelf klusartikelen. Of je nu een grote of kleine klus gaat verrichten; bij Hippolytushoef vind je alles wat je nodig hebt om van jouw klus een succes te maken. Zoek je inspiratie of advies over producten? Stel je vraag: onze deskundige medewerkers helpen je graag op weg. We zijn bijna elke dag open, maar voor de zekerheid bekijk je onze website voor een overzicht van alle openingstijden van Praxis Hippolytushoef. Zo weet je zeker dat je niet voor een gesloten deur staat, bijvoorbeeld op zon- en feestdagen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch4\u003ESterk in laminaat, verf en gereedschap\u003C\u002Fh4\u003E\u003Cp\u003EBij de Praxis in Hippolytushoef vind je alle bouwmaterialen, gereedschap en accessoires om je huis nog mooier te maken. Zowel de beginnende als de ervaren makers kunnen bij Hippolytushoef terecht voor hun klus benodigdheden. Ga je de muren van een nieuw laagje verf of behang voorzien? Wil je dat oude tapijt nu eindelijk eens verwisselen voor een mooie laminaatvloer? Of vind je het gewoon leuk om je eigen tuinmeubelen van steigerhout te maken? Hippolytushoef helpt je graag bij het realiseren van jouw klus. Ontdek het veelzijdige assortiment van de Praxis in Hippolytushoef of bekijk het aanbod online via praxis.nl.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EDo-it-yourself hardware store Hippolytushoef\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EPraxis is the hardware store in Hippolytushoef where you can go for all your do-it-yourself DIY items. Whether you are going to carry out a large or small job; at Hippolytushoef you will find everything you need to make your job a success. Are you looking for inspiration or advice about products? Ask your question: our expert employees are happy to help you on your way. We are open almost every day, but just to be sure, check out our website for an overview of all opening hours of Praxis Hippolytushoef. This way you can be sure that you are not standing in front of a closed door, for example on Sundays and public holidays.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EStrong in laminate, paint and tools\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAt the Praxis in Hippolytushoef you will find all building materials, tools and accessories to make your home even more beautiful. Both the novice and the experienced makers can contact Hippolytushoef for their DIY supplies. Are you going to provide the walls with a new layer of paint or wallpaper? Do you finally want to exchange that old carpet for a beautiful laminate floor? Or do you just enjoy making your own garden furniture from scaffolding wood? Hippolytushoef is happy to help you realize your job. Discover the versatile range of Praxis in Hippolytushoef or view the range online at praxis.nl.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EDo-it-yourself-Baumarkt Hippolytushoef\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EPraxis ist der Baumarkt in Hippolytushoef, in dem Sie alle Heimwerkerartikel kaufen können. Ob Sie einen großen oder kleinen Auftrag ausführen; Bei Hippolytushoef finden Sie alles, was Sie für einen erfolgreichen Job brauchen. Suchen Sie Inspiration oder Beratung zu Produkten? Stellen Sie Ihre Frage: Unsere kompetenten Mitarbeiter helfen Ihnen gerne weiter. Wir haben fast täglich geöffnet, aber um sicherzugehen, finden Sie auf unserer Website eine Übersicht aller Öffnungszeiten der Praxis Hippolytushoef. So können Sie sicher sein, dass Sie beispielsweise an Sonn- und Feiertagen nicht vor verschlossener Tür stehen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EStark in Laminat, Farbe und Werkzeug\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBei der Praxis in Hippolytushoef finden Sie alle Baumaterialien, Werkzeuge und Zubehör, um Ihr Zuhause noch schöner zu machen. Sowohl der Anfänger als auch der erfahrene Hersteller können Hippolytushoef für Heimwerkerbedarf kontaktieren. Möchten Sie die Wände mit einer neuen Schicht Farbe oder Tapete versehen? Wollen Sie endlich den alten Teppich gegen einen schönen Laminatboden eintauschen? Oder macht es Ihnen einfach Spaß, Ihre eigenen Gartenmöbel aus Gerüstholz herzustellen? Hippolytushoef unterstützt Sie gerne bei der Umsetzung Ihres Jobs. Entdecken Sie das vielseitige Angebot von Praxis in Hippolytushoef oder sehen Sie sich das Angebot online unter praxis.nl an.\u003C\u002Fp\u003E",phone:"0227592465",site:"https:\u002F\u002Fwww.praxis.nl\u002Fstoredetail\u002F2446\u002Fhippolytushoef",enabled:a},{id:"62ee3b96b974cb2998dd10fa",name:"RL Wheels Fietsen",category:d,coordinates:"52.907612380033065, 4.961454446222156",description:"\u003Cp\u003ERLWheels is de fietsenwinkel en fietsreparatiespecialist te Hippolytushoef, waar u onder meer nieuwe en tweedehands fietsen kunt kopen en uw fiets kunt laten repareren of onderhouden. Remco en Leander zijn als fietsspecialist de drijvende kracht achter RLWheels en zijn u graag van dienst.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg class=\"alignright wp-image-1413\" src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" width=\"384\" height=\"215\" srcset=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg 300w, https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht-280x157.jpg 280w\" sizes=\"(max-width: 384px) 100vw, 384px\" style=\"letter-spacing: 0.00714286em; background-color: rgb(30, 30, 30);\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EOoit als hobby begonnen en nu uitgegroeid tot een professionele fietsenwinkel in Hippolytushoef in de gemeente Hollands Kroon, waar naast de verkoop van nieuwe&nbsp;en tweedehands fietsen en fietsreparatie ook een groot aantal fietsaccessoires te koop wordt aangeboden.\u003C\u002Fp\u003E\u003Cp\u003ERLWheels is een allround fietsenhandel en fietsreparatiebedrijf, waar u bij het kopen van een nieuwe fiets desgewenst meteen een fietsverzekering kunt afsluiten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ERLWheels is the bicycle shop and bicycle repair specialist in Hippolytushoef, where you can buy new and second-hand bicycles and have your bicycle repaired or maintained. As bicycle specialists, Remco and Leander are the driving force behind RLWheels and are happy to assist you.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: rgb(30, 30, 30);\"\u003E\u003Cimg src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" height=\"215\" width=\"384\"\u003E\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003EIt once started as a hobby and has now grown into a professional bicycle shop in Hippolytushoef in the municipality of Hollands Kroon, where, in addition to the sale of new and second-hand bicycles and bicycle repair, a large number of bicycle accessories are also offered for sale.\u003C\u002Fp\u003E\u003Cp\u003ERLWheels is an all-round bicycle trade and bicycle repair company, where you can immediately take out bicycle insurance when buying a new bicycle.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ERLWheels ist das Fahrradgeschäft und der Fahrradreparaturspezialist in Hippolytushoef, wo Sie neue und gebrauchte Fahrräder kaufen und Ihr Fahrrad reparieren oder warten lassen können. Als Fahrradspezialisten sind Remco und Leander die treibende Kraft hinter RLWheels und helfen Ihnen gerne weiter.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" height=\"215\" width=\"384\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EEs begann einst als Hobby und hat sich mittlerweile zu einem professionellen Fahrradgeschäft in Hippolytushoef in der Gemeinde Hollands Kroon entwickelt, in dem neben dem Verkauf von neuen und gebrauchten Fahrrädern und der Fahrradreparatur auch eine große Anzahl von Fahrradzubehör angeboten wird zum Verkauf angeboten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ERLWheels ist ein Allround-Fahrradhandel und Fahrradreparaturbetrieb, bei dem Sie beim Kauf eines neuen Fahrrads sofort eine Fahrradversicherung abschließen können.\u003C\u002Fp\u003E",email:"info@rlwheels.nl",phone:"0618508227",site:"http:\u002F\u002Fwww.rlwheels.nl\u002F",enabled:a},{id:"62ee3c22b974cb2998dd10fb",name:"Sstyle Beenmode",category:d,coordinates:"52.90627963758573, 4.9610812118765395",description:"\u003Cp\u003EIs het je al opgevallen dat veel inwoners in&nbsp;Hippolytushoef&nbsp;trendy beenmode dragen? Er is een logische verklaring daarvoor; midden in het gezellige centrum kun je namelijk Sstyle Beenmode vinden. En hier vind je de&nbsp;mooiste merken in beenmode.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVan&nbsp;Calvin Klein&nbsp;sokken, tot&nbsp;Oroblu&nbsp;legwear, van draagbare&nbsp;Babouche&nbsp;boots tot goede billen in&nbsp;Muchachomalo's. Sstyle heeft het gegarandeerd. Leuk voor jezelf, maar misschien zelfs nóg leuker om cadeau te doen (tip: wij hebben ook&nbsp;cadeaubonnen). Tot snel!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EHave you noticed that many residents in Hippolytushoef wear trendy legwear? There is a logical explanation for this; In the middle of the cozy center you can find Sstyle Beenmode. And here you will find the most beautiful brands in legwear.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EFrom Calvin Klein socks, to Oroblu legwear, from wearable Babouche boots to good buttocks in Muchachomalo's. Sstyle has it guaranteed. Nice for yourself, but maybe even more fun to give as a gift (tip: we also have gift vouchers). See you soon!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EIst Ihnen aufgefallen, dass viele Bewohner von Hippolytushoef trendige Beinkleider tragen? Dafür gibt es eine logische Erklärung; Mitten im gemütlichen Zentrum finden Sie Sstyle Beenmode. Und hier finden Sie die schönsten Marken der Legwear.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVon Calvin-Klein-Socken bis hin zu Beinbekleidung von Oroblu, von tragbaren Babouche-Stiefeln bis hin zu guten Pobacken im Muchachomalo's. Sstyle hat es garantiert. Schön für sich selbst, aber vielleicht noch mehr Spaß beim Verschenken (Tipp: Wir haben auch Geschenkgutscheine). Bis bald!\u003C\u002Fp\u003E",phone:"0657107994",site:"https:\u002F\u002Fsstyle.nl\u002F",enabled:a},{id:"62ee3caab974cb2998dd10fc",name:"Installatiebedrijf S.Smit",category:d,coordinates:"52.90536520868946, 4.957002015884866",description:"\u003Cp\u003EAl meer dan 50 jaar is S. Smit installatietechniek een begrip op Wieringen en in de omgeving. Van een ambachtelijk bedrijfje is het uitgegroeid tot een modern en flexibel bedrijf. Persoonlijke aandacht en betrokkenheid bij iedere opdracht vinden wij erg belangrijk; graag worden wij uitgedaagd een oplossing te bedenken voor uw specifieke wens. En dat willen we graag zo houden.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIn de loop der jaren hebben we de vele ontwikkelingen op het vakgebied op de voet gevolgd; zodat we buiten het reguliere installatiewerk ook ervaren en volkomen ‘up to date’ zijn op het gebied van luchtbehandeling, zonne-energiesystemen, energiezuinige lage-temperatuur-vloerverwarming én vloerkoeling, hout-cv installaties en&nbsp;warmtepompen. Ook een combinatie van bijvoorbeeld een zon-thermische en hout-cv-installatie, al dan niet uitgebreid met een buffervat&nbsp;is mogelijk. De mogelijkheden zijn eigenlijk onbeperkt; niet alleen in de particuliere sector, maar ook in de horeca en utiliteit.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EBedrijfspand aan de Beltstraat\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ES. Smit installation technology has been a household name on Wieringen and in the surrounding area for more than 50 years. From a traditional company it has grown into a modern and flexible company. Personal attention and involvement in every assignment is very important to us; we like to be challenged to come up with a solution for your specific wishes. And we would like to keep it that way.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EOver the years we have closely followed the many developments in the field; so that, outside the regular installation work, we are also experienced and completely 'up to date' in the field of air treatment, solar energy systems, energy-efficient low-temperature floor heating and floor cooling, wood central heating installations and heat pumps. A combination of, for example, a solar thermal and wood central heating system, whether or not extended with a buffer tank, is also possible. The possibilities are actually limitless; not only in the private sector, but also in the hospitality and utility sectors.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent); background-color: rgb(13, 7, 53);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EBusiness premises on Beltstraat\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ES. Smit Installationstechnik ist seit mehr als 50 Jahren ein Begriff auf Wieringen und Umgebung. Aus einem Traditionsunternehmen ist ein modernes und flexibles Unternehmen geworden. Persönliche Aufmerksamkeit und Engagement bei jedem Auftrag ist uns sehr wichtig; Wir lassen uns gerne herausfordern, um eine Lösung für Ihre speziellen Wünsche zu finden. Und das möchten wir gerne beibehalten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIm Laufe der Jahre haben wir die vielen Entwicklungen auf diesem Gebiet genau verfolgt; sodass wir auch außerhalb der regulären Installationsarbeiten in den Bereichen Luftaufbereitung, Solaranlagen, energieeffiziente Niedertemperatur-Fußbodenheizungen und -kühlungen, Holzzentralheizungen und Wärmepumpen erfahren und absolut „up to date“ sind . Auch eine Kombination aus z. B. Solarthermie und Holzzentralheizung mit oder ohne Pufferspeichererweiterung ist möglich. Die Möglichkeiten sind eigentlich grenzenlos; nicht nur in der Privatwirtschaft, sondern auch im Gastgewerbe und Versorgungssektor.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent); background-color: rgb(13, 7, 53);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EGeschäftsräume in der Beltstraat\u003C\u002Fp\u003E",email:"info@ssmit.nl",phone:"0227591316",site:"https:\u002F\u002Fssmit.nl\u002F",enabled:a},{id:"62ee3d1db974cb2998dd10fd",name:"Stoer Mode",category:d,coordinates:"52.90632055949511, 4.961049877817161",description:"\u003Cp\u003EStoere mode voor jong en oud!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ECool fashion for young and old!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ECoole Mode für Jung und Alt!\u003C\u002Fp\u003E",email:"stoermode@hotmail.com",phone:"0648612837",site:"https:\u002F\u002Fwww.facebook.com\u002FStoerModeHippo\u002F",enabled:a},{id:"62ee3da4b974cb2998dd10fe",name:"Studio Marlies",category:d,coordinates:"52.907158920534584, 4.961384395663431",description:"\u003Cp\u003EHaarstylist &amp; visagist\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EHairstylist &amp; makeup artist\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EHairstylistin und Maskenbildnerin\u003C\u002Fp\u003E",email:"studiomarlies@ziggo.nl",phone:"0683211912",site:"https:\u002F\u002Fwww.instagram.com\u002FStudioMarlies\u002F",enabled:a},{id:"62ee3e19b974cb2998dd10ff",name:"Dierenspeciaalzaak 't Warme Nest",category:d,coordinates:"52.90776578333325, 4.962152369230831",description:"\u003Cp\u003EDierenspeciaalzaak 't Warme Nest is een veelzijdige en betrokken dierenspeciaalzaak gespecialiseerd in honden en katten. Bij ons kunt u terecht voor eerlijk advies. In de winkel beschikken wij over een zeer ruim assortiment producten voor honden en katten.\u003C\u002Fp\u003E\u003Cp\u003EIn onze webshop vind u daarvan een groot gedeelte terug.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EPet store 't Warme Nest is a versatile and committed pet store specialized in dogs and cats. You can contact us for honest advice. In the store we have a very wide range of products for dogs and cats.\u003C\u002Fp\u003E\u003Cp\u003EYou will find a large part of this in our webshop.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ETierhandlung 't Warme Nest ist eine vielseitige und engagierte Tierhandlung, die sich auf Hunde und Katzen spezialisiert hat. Sie können uns für eine ehrliche Beratung kontaktieren. Im Geschäft haben wir eine sehr große Auswahl an Produkten für Hunde und Katzen.\u003C\u002Fp\u003E\u003Cp\u003EEinen großen Teil davon finden Sie in unserem Webshop.\u003C\u002Fp\u003E",email:"info@warmenest.nl",phone:"0227595211",site:"https:\u002F\u002Fwww.warmenest.nl\u002F",enabled:a},{id:"62ee3e83b974cb2998dd1100",name:"Tutto Woonstijl",category:d,coordinates:"52.90777752734256, 4.962278369362164",description:"\u003Cp\u003EVloeren, Raamdecoratie, Wandbekleding, meubels en interieuradvies op maat\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa !\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EFloors, Window decoration, Wall coverings, furniture and tailor-made interior advice\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EFußböden, Fensterdekoration, Wandverkleidungen, Möbel und maßgeschneiderte Einrichtungsberatung\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa!\u003C\u002Fp\u003E",email:"info@tuttowoonstijl.nl",phone:"0621328303",site:"http:\u002F\u002Fwww.tuttowoonstijl.nl\u002F",enabled:a},{id:"62ee3f24b974cb2998dd1101",name:"Ukkie Shop",category:d,coordinates:"52.90625954332816, 4.961002868973696",description:"\u003Cp\u003EDe naam Ukkie Shop vertegenwoordigt niet het uitgebreide assortiment van de winkel. Bij de naam Ukkie Shop denkt u aan een babywinkel. In 2007 zijn wij inderdaad gestart als babykadowinkel met maar 30 m2. Sinds 2017 zijn wij verhuisd naar een pand met ruim 300m2. Het baby assortiment is inmiddels uitgegroeid tot een klein warenhuis. Een soort “winkel van sinkel” waar NEE niet te koop is.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij staan bekend om onze unieke kraampakketten, groot assortiment , service, creativiteit, bereidwilligheid en vriendelijkheid. Het is een feestje om onze winkel te bezoeken. U wordt vriendelijk en gastvrij ontvangen. Klant is koning. Kom gerust een keer kijken en laat u verrassen door ons grote aanbod. En is het artikel wat u zoekt er niet? Dan doen wij onze uiterste best om het voor u te regelen.\u003C\u002Fp\u003E\u003Cp\u003EIeder cadeau krijgt speciale aandacht! Wij staan garant voor een verzorgd en keurig ingepakte cadeautje. Heeft u persoonlijke wensen? Laat het ons weten, er is veel mogelijk!\u003C\u002Fp\u003E\u003Cp\u003EKom eens bij ons langs. Of snuffel in de webwinkel. Ik moet u wel bekennen dat deze niet altijd helemaal up to date is. Dagelijks komen er artikelen binnen, we doen ons best zoveel mogelijk op de site te plaatsen en te vernieuwen maar het ontbreekt ons wel eens aan tijd. Sorry daarvoor. Uiteraard wordt alles altijd netjes afgehandeld en geregeld.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe name Ukkie Shop does not represent the extensive range of the store. When you think of the name Ukkie Shop, you think of a baby store. In 2007 we indeed started as a baby gift shop with only 30 m2. Since 2017 we have moved to a building with more than 300m2. The baby range has now grown into a small department store. A kind of \"sinkel shop\" where NO is not for sale.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe are known for our unique maternity packages, wide range, service, creativity, willingness and friendliness. It is a pleasure to visit our store. You will be welcomed in a friendly and hospitable manner. Customer is king. Come and have a look and be surprised by our wide range. And is the article you are looking for not there? Then we will do our utmost to arrange it for you.\u003C\u002Fp\u003E\u003Cp\u003EEvery gift gets special attention! We guarantee a neat and neatly wrapped gift. Do you have personal wishes? Let us know, a lot is possible!\u003C\u002Fp\u003E\u003Cp\u003ECome and visit us. Or browse the web store. I must confess that it is not always completely up to date. Articles come in every day, we do our best to place and update as much as possible on the site, but we sometimes lack time. Sorry about that. Of course everything is always neatly handled and arranged.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Name Ukkie Shop repräsentiert nicht das umfangreiche Sortiment des Ladens. Wenn Sie an den Namen Ukkie Shop denken, denken Sie an einen Babyladen. 2007 haben wir tatsächlich als Baby-Geschenkeladen mit nur 30 m2 angefangen. Seit 2017 sind wir in ein Gebäude mit mehr als 300m2 umgezogen. Aus dem Babysortiment ist inzwischen ein kleines Kaufhaus geworden. Eine Art „Sinkelladen“, in dem es NO nicht zu kaufen gibt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir sind bekannt für unsere einzigartigen Mutterschaftspakete, breites Angebot, Service, Kreativität, Bereitschaft und Freundlichkeit. Es ist eine Freude, unseren Laden zu besuchen. Sie werden freundlich und gastfreundlich empfangen. Der Kunde ist König. Schauen Sie vorbei und lassen Sie sich von unserem breiten Angebot überraschen. Und ist der gesuchte Artikel nicht dabei? Dann werden wir unser Möglichstes tun, um es für Sie zu arrangieren.\u003C\u002Fp\u003E\u003Cp\u003EJedes Geschenk bekommt besondere Aufmerksamkeit! Wir garantieren ein ordentlich und ordentlich verpacktes Geschenk. Sie haben persönliche Wünsche? Lassen Sie es uns wissen, vieles ist möglich!\u003C\u002Fp\u003E\u003Cp\u003EKomm und besuche uns. Oder stöbern Sie im Webshop. Ich muss gestehen, dass es nicht immer ganz aktuell ist. Artikel kommen jeden Tag, wir tun unser Bestes, um so viel wie möglich auf der Seite zu platzieren und zu aktualisieren, aber manchmal fehlt uns die Zeit. Das tut mir leid. Natürlich ist alles immer ordentlich gehandhabt und geordnet.\u003C\u002Fp\u003E",email:"info@babykadowinkelukkieshop.nl",phone:"0227591485",site:"http:\u002F\u002Fwww.babykadowinkelukkieshop.nl\u002F",enabled:a},{id:"62ee3f97b974cb2998dd1102",name:"Uit Eigen Streek Delicatessen",category:d,coordinates:"52.90777989095442, 4.962274866991479",description:"\u003Cp\u003EUit Eigen Streek Delicatessen en Cadeaus is gevestigd&nbsp;voorin de Tutto Concept Store aan het Kerkplein 23 in Hippolytushoef. Let op!&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EOok op de Weekmarkt in Schagen op donderdagochtend en op de Zee Verse Vismarkt in Den Oever elke zaterdagochtend, heeft Uit Eigen Streek een vaste plek.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EUit Eigen Streek Delicatessen and Gifts is located in the front of the Tutto Concept Store at Kerkplein 23 in Hippolytushoef. NB!\u003C\u002Fp\u003E\u003Cp\u003EUit Eigen Streek also has a permanent place at the Weekmarkt in Schagen on Thursday mornings and at the Zee Verse Vismarkt in Den Oever every Saturday morning.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUit Eigen Streek Delicatessen and Gifts befindet sich vor dem Tutto Concept Store am Kerkplein 23 in Hippolytushoef. Achtung!\u003C\u002Fp\u003E\u003Cp\u003EUit Eigen Streek hat außerdem jeden Donnerstagmorgen einen festen Platz auf dem Wochenmarkt in Schagen und jeden Samstagmorgen auf dem Zee Verse Vismarkt in Den Oever.\u003C\u002Fp\u003E",email:"info@uiteigenstreek.nl",phone:"0620010072",site:"http:\u002F\u002Fwww.uiteigenstreek.nl\u002F",enabled:a},{id:"62ee401eb974cb2998dd1103",name:"Van Dijk Optiek",category:d,coordinates:"52.906506911523145, 4.961122880324851",description:"\u003Cp\u003EVan Dijk Optiek is in Julianadorp al sinds 1992 gevestigd in Winkelcentrum Dorperweerth. We zijn inmiddels uitgegroeid tot dé specialist voor Julianadorp en omstreken op het gebied van brillen en lenzen. Onder leiding van opticien Ricardo Hertzberger staat een deskundig en enthousiast team klaar om u van dienst te zijn.\u003C\u002Fp\u003E\u003Cp\u003EBij Van Dijk Optiek treft u een breed assortiment van brillen, zonnebrillen en lenzen aan. Naast een moderne uitstraling staan oogzorg en service hoog in het vaandel. Van Dijk Optiek is aangesloten bij een inkooporganisatie van meer dan 350 opticiens. Dit zorgt ervoor dat naast kwaliteit en service ook de prijs aantrekkelijk blijft. Alle oogmetingen en lensaanpassingen worden gedaan door een ANVC gecertificeerde contactlensspecialist cq, gediplomeerde vakbekwame opticien.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EVan Dijk Optiek has been located in the Dorperweerth Shopping Center in Julianadorp since 1992. We have now grown into the specialist for Julianadorp and the surrounding area in the field of glasses and lenses. Led by optician Ricardo Hertzberger, an expert and enthusiastic team is ready to serve you.\u003C\u002Fp\u003E\u003Cp\u003EAt Van Dijk Optics you will find a wide range of glasses, sunglasses and lenses. In addition to a modern look, eye care and service are of paramount importance. Van Dijk Optiek is affiliated with a purchasing organization of more than 350 opticians. This ensures that, in addition to quality and service, the price also remains attractive. All eye measurements and lens adjustments are done by an ANVC certified contact lens specialist or qualified optician.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EVan Dijk Optiek befindet sich seit 1992 im Einkaufszentrum Dorperweerth in Julianadorp. Mittlerweile sind wir zum Spezialisten für Julianadorp und Umgebung im Bereich Brillen und Linsen gewachsen. Unter der Leitung von Optiker Ricardo Hertzberger steht Ihnen ein kompetentes und enthusiastisches Team zur Verfügung.\u003C\u002Fp\u003E\u003Cp\u003EBei Van Dijk Optics finden Sie eine große Auswahl an Brillen, Sonnenbrillen und Linsen. Neben einem modernen Look sind Augenpflege und Service von größter Bedeutung. Van Dijk Optiek ist einer Einkaufsorganisation von mehr als 350 Optikern angeschlossen. So bleibt neben Qualität und Service auch der Preis attraktiv. Alle Augenmessungen und Linsenanpassungen werden von einem ANVC-zertifizierten Kontaktlinsenspezialisten oder einem qualifizierten Optiker durchgeführt.\u003C\u002Fp\u003E",email:"info@vandijkoptiekjulianadorp.nl",phone:"0227591057",site:"http:\u002F\u002Fwww.vandijkoptiekjulianadorp.nl\u002F",enabled:a},{id:"62ee4144b974cb2998dd1105",name:"Fietsverhuur - Sport Nu - Mooi Wieringen!",category:m,coordinates:"52.89393116724986, 4.930148680116178",description:"\u003Cp\u003E\u003Cstrong\u003EOntdek sportief, het voormalig eiland in de Zuiderzee!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EOf het nu een bedrijfsuitje, groepstraining, kinderfeestje of wandelexcursie is, we gaan je op een gezellige, sportieve en avontuurlijke manier kennis laten maken met het voormalig eiland Wieringen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EActief bezig zijn wordt een ontspannen ervaring!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EDiscover sporty, the former island in the Zuiderzee!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWhether it is a company outing, group training, children's party or walking excursion, we will introduce you to the former island of Wieringen in a fun, sporty and adventurous way.\u003C\u002Fp\u003E\u003Cp\u003EBeing active becomes a relaxing experience!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EEntdecken Sie sportlich die ehemalige Insel in der Zuiderzee!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EOb Betriebsausflug, Gruppentraining, Kinderfest oder Wanderausflug, wir bringen Ihnen die ehemalige Insel Wieringen spielerisch, sportlich und abenteuerlich näher.\u003C\u002Fp\u003E\u003Cp\u003EAktiv sein wird zum entspannenden Erlebnis!\u003C\u002Fp\u003E",email:"info@sport-nu.nl",phone:"0618421534",site:"https:\u002F\u002Fwww.sport-nu.nl\u002F",enabled:a},{id:"62ee41e7b974cb2998dd1106",name:"De Groot Recreatie - Wadlopen",category:m,coordinates:"52.92423385280675, 4.987049389078203",description:"\u003Ch4\u003EWadlopen op Wieringen\u003C\u002Fh4\u003E\u003Cp\u003EDe Groot Recreatie organiseert diverse wadlooptochten vanuit Noord-Holland op het voormalig eiland Wieringen, gelegen aan het Werelderfgoed Waddenzee. Onder begeleiding van een ervaren gids kunt u, tijdens het wadlopen, aan den lijve ondervinden hoe uniek dit prachtige stuk natuur is.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EHet wadlopen lokt een enorme drang tot vrijheid uit. Modder, water en een prachtige wijde omgeving zijn ingrediënten voor een heerlijk actief ontspannen activiteit.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1024\u002Fwadlooptochten-03.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe gaan met de boot varen, zeehonden kijken, daarna met z'n allen wadlopen naar de dijk, of aan boord blijven, voor diegene die niet mee kunnen lopen.\u003C\u002Fp\u003E\u003Cp\u003EDan gezellig nazitten en eten in ons restaurant. U kunt het wadlopen ook combineren met andere recreatiemogelijkheden. Zo kunnen we de sportieve, maar ook de minder sportieve deelnemer een leuke dag bieden.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EMudflat walking on Wieringen\u003C\u002Fp\u003E\u003Cp\u003EDe Groot Recreatie organizes various mudflat walks from North Holland on the former island of Wieringen, located on the Wadden Sea World Heritage. Accompanied by an experienced guide, you can experience for yourself how unique this beautiful piece of nature is while walking on the mudflats.\u003C\u002Fp\u003E\u003Cp\u003EWalking on the mudflats provokes an enormous urge for freedom. Mud, water and a beautiful wide area are ingredients for a wonderfully active relaxing activity.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1024\u002Fwadlooptochten-03.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe will sail by boat, watch seals, then walk all over the mudflats to the dike, or stay on board, for those who can't walk along.\u003C\u002Fp\u003E\u003Cp\u003EThen sit back and eat in our restaurant. You can also combine mudflat hiking with other recreational options. This way we can offer the sporty, but also the less sporty participant a fun day.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EWattwandern auf Wieringen\u003C\u002Fp\u003E\u003Cp\u003EDe Groot Recreatie organisiert verschiedene Wattwanderungen von Nordholland auf der ehemaligen Insel Wieringen, die sich im Weltnaturerbe Wattenmeer befindet. Begleitet von einem erfahrenen Guide können Sie bei einer Wattwanderung selbst erleben, wie einzigartig dieses schöne Stück Natur ist.\u003C\u002Fp\u003E\u003Cp\u003EDas Wattwandern weckt einen enormen Freiheitsdrang. Schlamm, Wasser und eine schöne weite Fläche sind Zutaten für eine wunderbar aktive Entspannungsaktivität.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1024\u002Fwadlooptochten-03.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir fahren mit dem Boot, beobachten Seehunde, wandern dann über das Watt zum Deich oder bleiben an Bord, für diejenigen, die nicht mitgehen können.\u003C\u002Fp\u003E\u003Cp\u003EDann lehnen Sie sich zurück und essen Sie in unserem Restaurant. Sie können das Wattwandern auch mit anderen Freizeitmöglichkeiten kombinieren. So können wir dem sportlichen, aber auch dem weniger sportlichen Teilnehmer einen unterhaltsamen Tag bieten.\u003C\u002Fp\u003E",email:r,phone:s,site:"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fnl\u002Factiviteiten\u002Fwadlopen\u002F",enabled:a},{id:"62ee428fb974cb2998dd1107",name:"De Groot Recreatie - Garnalen vissen",category:m,coordinates:"52.93447386866627, 5.039326059031218",description:"\u003Cp\u003EGarnalen vissen en varen langs lepelaars en zeehonden (bij laag water) vanuit de haven Den Oever met de WR117. Aankomst met koffie aan boord. Rondvaart door de visserijhaven van Den Oever met uitleg over de bezienswaardigheden en vissersschepen. We varen langs de spuisluizen in de Afsluitdijk, waar sinds kort stroom wordt opgewekt door middel van een propeller in het stromende water. Als we buiten de haven komen wordt het net uitgezet, waar uitleg over wordt gegeven aan de gasten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalen-pellen-waddenzee-05-1.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003ENa ongeveer een half uur wordt het net omhoog gehaald en de vangst verdeeld over het dek. We laten de gasten de vangst bekijken in bakken water, zodat alles in leven blijft. Een deel van de garnalen wordt gezeefd. Inmiddels zijn we aangekomen bij de zeehonden. Vanaf geringe afstand kunnen we ze goed bekijken. Dan zetten we koers terug naar de haven.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalenvissen-wieringen-04.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003ETijdens de terugvaart wordt een deel van de grote garnalen aan boord gekookt. Er kunnen garnalen worden gepeld en geproefd. Ongepelde garnalen worden in porties verdeeld om mee te nemen. Ons dek is gedeeltelijk overdekt, dus ook met slecht weer kan deze tocht doorgaan.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fvissen-waddenzee-de-zee-leeft-06.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EFish shrimp and sail past spoonbills and seals (at low tide) from Den Oever harbor with the WR117. Arrival with coffee on board. Cruise through the fishing port of Den Oever with explanations about the sights and fishing vessels. We sail past the discharge sluices in the Afsluitdijk, where electricity has recently been generated by means of a propeller in the flowing water. When we get outside the harbour, the net is put out, where an explanation is given to the guests.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalen-pellen-waddenzee-05-1.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EAfter about half an hour the net is raised and the catch is spread over the deck. We let the guests view the catch in tubs of water, so that everything stays alive. Part of the shrimp is sieved. We have now arrived at the seals. We can see them well from a short distance. Then we set course back to port.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalenvissen-wieringen-04.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EDuring the return trip, some of the large shrimps are cooked on board. Shrimp can be peeled and tasted. Whole prawns are portioned for takeout. Our deck is partially covered, so this tour can continue even in bad weather.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fvissen-waddenzee-de-zee-leeft-06.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EAngeln Sie Garnelen und segeln Sie mit der WR117 vom Hafen Den Oever aus an Löfflern und Robben vorbei (bei Ebbe). Ankunft mit Kaffee an Bord. Fahren Sie durch den Fischereihafen von Den Oever mit Erläuterungen zu den Sehenswürdigkeiten und Fischereifahrzeugen. Wir fahren an den Austragsschleusen im Afsluitdijk vorbei, wo neuerdings mit einem Propeller im fließenden Wasser Strom erzeugt wird. Als wir den Hafen verlassen, wird das Netz ausgeworfen, wo den Gästen eine Erklärung gegeben wird.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalen-pellen-waddenzee-05-1.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003ENach etwa einer halben Stunde wird das Netz gehoben und der Fang über das Deck verteilt. Damit alles am Leben bleibt, lassen wir die Gäste den Fang in Wasserwannen anschauen. Ein Teil der Garnelen wird gesiebt. Wir sind jetzt bei den Robben angekommen. Wir können sie aus kurzer Entfernung gut sehen. Dann setzen wir Kurs zurück zum Hafen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fgarnalenvissen-wieringen-04.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EAuf der Rückfahrt werden einige der großen Garnelen an Bord gekocht. Garnelen können geschält und probiert werden. Ganze Garnelen werden zum Mitnehmen portioniert. Unser Deck ist teilweise überdacht, sodass diese Tour auch bei schlechtem Wetter fortgesetzt werden kann.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1025\u002Fvissen-waddenzee-de-zee-leeft-06.jpg\" width=\"850\"\u003E\u003C\u002Fp\u003E",email:r,phone:s,site:"https:\u002F\u002Fwww.degrootrecreatie.nl\u002Fnl\u002Factiviteiten\u002Fgarnalenvissen\u002F",enabled:a},{id:"62ee42fbb974cb2998dd1108",name:"Wieringer Eilandmuseum Jan Lont",category:g,coordinates:"52.9291686908877, 4.985844584764133",description:"\u003Cp\u003EOp het voormalige Zuiderzee-eiland Wieringen, staat vlakbij de de Waddenzee, de boerderij van laatste bewoner en eigenaar Jan Lont, nu het Wieringer Eilandmuseum.\u003C\u002Fp\u003E\u003Cp\u003EBeleef hier samen met uw kinderen het Wieringer boeren- en vissersleven van weleer.\u003C\u002Fp\u003E\u003Cp\u003EWij bieden u, samen met andere organisaties, leuke arrangementen aan: wandelen, fietsen, varen of rijden. Prachtige mogelijkheden om het voormalige eiland te leren kennen.\u003C\u002Fp\u003E\u003Cp\u003EOntdek het museum en het Wieringer culturele erfgoed alvast via de informatie op deze site.\u003C\u002Fp\u003E\u003Cp\u003EU bent van harte uitgenodigd het museum met een bezoek te vereren, waar u vriendelijk ontvangen zal worden door een van onze vele vrijwilligers met een gratis kopje koffie of thee.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EGraag tot ziens in het Wieringer Eilandmuseum!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EOn the former Zuiderzee island of Wieringen, near the Waddenzee, the farm of the last resident and owner Jan Lont, now the Wieringer Eilandmuseum.\u003C\u002Fp\u003E\u003Cp\u003EExperience the Wieringer farming and fishing life of yesteryear with your children.\u003C\u002Fp\u003E\u003Cp\u003ETogether with other organisations, we offer you nice packages: walking, cycling, sailing or driving. Wonderful opportunities to get to know the former island.\u003C\u002Fp\u003E\u003Cp\u003EDiscover the museum and Wieringer's cultural heritage via the information on this site.\u003C\u002Fp\u003E\u003Cp\u003EYou are cordially invited to pay a visit to the museum, where you will be kindly received by one of our many volunteers with a free cup of coffee or tea.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe look forward to seeing you in the Wieringer Eilandmuseum!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EAuf der ehemaligen Zuiderzeeinsel Wieringen, nahe dem Wattenmeer, der Hof des letzten Bewohners und Besitzers Jan Lont, heute das Wieringer Eilandmuseum.\u003C\u002Fp\u003E\u003Cp\u003EErleben Sie mit Ihren Kindern das Wieringer Bauern- und Fischerleben von einst.\u003C\u002Fp\u003E\u003Cp\u003EZusammen mit anderen Organisationen bieten wir Ihnen schöne Pakete an: Wandern, Radfahren, Segeln oder Autofahren. Herrliche Möglichkeiten, die ehemalige Insel kennenzulernen.\u003C\u002Fp\u003E\u003Cp\u003EEntdecken Sie das Museum und das kulturelle Erbe Wieringers über die Informationen auf dieser Seite.\u003C\u002Fp\u003E\u003Cp\u003ESie sind herzlich eingeladen, das Museum zu besuchen, wo Sie von einem unserer vielen Freiwilligen mit einer kostenlosen Tasse Kaffee oder Tee empfangen werden.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir freuen uns auf Ihren Besuch im Wieringer Eilandmuseum!\u003C\u002Fp\u003E",email:"info@museumjanlont.nl",phone:"0227511353",site:"https:\u002F\u002Fwww.museumjanlont.nl\u002F",enabled:a},{id:"62ee436fb974cb2998dd1109",name:"Viking Informatiecentrum",category:g,coordinates:"52.92916087635083, 5.027701841085486",description:"\u003Cp\u003EHet Viking Informatiecentrum op Wieringen, in de wandelgangen beter bekend als VIC, is in 2004 gestart als een bezoekerscentrum.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EDe aanleiding voor de bouw is de vondst van twee zilverschatten, toegeschreven aan de Vikingen, nabij Westerklief op Wieringen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Viking Information Center on Wieringen, better known as VIC in the corridors, started in 2004 as a visitor center.\u003C\u002Fp\u003E\u003Cp\u003EThe reason for the construction is the discovery of two silver treasures, attributed to the Vikings, near Westerklief on Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDas Wikinger Informationszentrum auf Wieringen, in den Gängen besser bekannt als VIC, startete 2004 als Besucherzentrum.\u003C\u002Fp\u003E\u003Cp\u003EAnlass für den Bau ist der Fund zweier den Wikingern zugeschriebener Silberschätze beim Westerklief auf Wieringen.\u003C\u002Fp\u003E",email:"info@vikingen.nl",phone:t,site:"http:\u002F\u002Fwww.vikingen.nl\u002F",enabled:a},{id:"62ee43e6b974cb2998dd110a",name:"VVV Den Oever",category:g,coordinates:"52.9291437168049, 5.027485497183083",description:"\u003Cp\u003EDe&nbsp;Kop&nbsp;van&nbsp;Noord‑Holland is een authentiek stukje Holland. Het heeft statistisch gezien de meeste zonuren, mooie zandstranden, een rijk gevarieerd binnenland en is omringd door drie totaal verschillende kusten: Noordzee, Waddenzee en IJsselmeer.\u003C\u002Fp\u003E\u003Cp\u003EVan dagverse vis in Den Helder of Den Oever en Westfriese Folklore in marktstad Schagen tot UNESCO werelderfgoed De Waddenzee. Er zijn 115 wandelroutes met een totale lengte van 770 kilometer, maar ook eindeloze fietsroutes door duinen en langs dorpskernen. De kust is maar liefst 30 kilometer lang met stranden speciaal voor families en internationaal bekende kite-hotspots.&nbsp;\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Kop van Noord-Holland is an authentic part of Holland. Statistically, it has the most hours of sunshine, beautiful sandy beaches, a richly varied interior and is surrounded by three completely different coasts: North Sea, Wadden Sea and IJsselmeer.\u003C\u002Fp\u003E\u003Cp\u003EFrom fresh fish in Den Helder or Den Oever and West Frisian Folklore in the market town of Schagen to UNESCO World Heritage Site The Wadden Sea. There are 115 walking routes with a total length of 770 kilometers, but also endless cycling routes through dunes and along village centers. The coast is no less than 30 kilometers long with beaches especially for families and internationally known kite hotspots.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Kop van Noord-Holland ist ein authentisches Stück Holland. Statistisch gesehen hat es die meisten Sonnenstunden, schöne Sandstrände, ein abwechslungsreiches Binnenland und ist von drei völlig unterschiedlichen Küsten umgeben: Nordsee, Wattenmeer und IJsselmeer.\u003C\u002Fp\u003E\u003Cp\u003EVon frischem Fisch in Den Helder oder Den Oever und westfriesischer Folklore in der Marktgemeinde Schagen bis zum UNESCO-Weltnaturerbe Wattenmeer. Es gibt 115 Wanderrouten mit einer Gesamtlänge von 770 Kilometern, aber auch endlose Fahrradrouten durch Dünen und entlang der Dorfzentren. Die Küste ist nicht weniger als 30 Kilometer lang mit Stränden speziell für Familien und international bekannten Kite-Hotspots.\u003C\u002Fp\u003E",email:"info@hollandbovenamsterdam.com",phone:t,site:"http:\u002F\u002Fwww.vvvtopvanholland.nl\u002F",enabled:a},{id:"62e97341cb24f8f4fa9997b8",name:"Peilhuisje Quarantaine",coordinates:"52.894111361080775, 4.908735906373444",description:"\u003Cp\u003EHet peilschaalhuisje in Westerland is een van de twee peilschaalhuisjes op Wieringen. De andere staat in de Vissershaven van Den Oever. Beide peilschaalhuisjes dateren uit het jaar 1919. Toen werden ze gebouwd in opdracht van Rijkswaterstaat. De peilschaalhuisjes werden ingezet om de waterstand vast te leggen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVanuit dit huisje vond de controle plaats van de waterstand ten behoeve van de dijkbewaking. Een of meerdere keren per dag werd hier de beweging van het water gemeten. Na de oorlog nam de computer het meetwerk over en zijn de meeste huisjes onbruik geraakt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDoor het afsluiten van de Zuiderzee begon het noordelijk gebied van Wieringen te verzanden. De eb en vloedstromen die het betrokken gebied op diepte hielden veranderden naarmate de afsluiting vorderde. De stromingen werden als het ware gedwongen een ander richting te kiezen. De verzanding nam op een gegeven moment dusdanige vormen aan dat de waterhoogte, aan de Quarantaineweg niet meer kon worden gemeten. In 1939 werd de apparatuur uit het huisje verwijderd, het huisje heeft nog jarenlang dienst gedaan als schuilonderkomen voor mensen die tijdens zware storm wacht liepen op de dijken.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EHet peilschaalhuis aan de haven van Den Oever heeft nog jarenlang de taak overgenomen van de verzandde peilschaal aan de Quarantaineweg, tot tenslotte reeds voor de oorlog ook deze in onbruik raakte, wanneer hier de apparatuur is verwijderd is niet bekend.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62e9738fcb24f8f4fa9997b9",name:"Hoogste punt van Wieringen",coordinates:"52.8938543902826, 4.923507240209394",description:e,enabled:a,category:b},{id:"62e973b6cb24f8f4fa9997ba",name:"Lutjestrand",coordinates:"52.88792065376204, 4.914078993160453",description:"\u003Cp\u003EDit is misschien wel het oudste strand van Noord-Holland, het zand is namelijk al meer dan 100.000 jaar oud. Het recreatiestrandje ligt aan het Amstelmeer in de Kop van Noord-Holland. Het strand heeft een kitesurfstrand, een windsurfstrand en een zandstrand. Op het zandstrand staan verschillende speeltoestellen voor verschillende leeftijden (zoals een watertafel en een volleybalnet). Daarbij heeft het zandstrand een zwembassin zodat je altijd blauwalgvrij kan zwemmen. Rondom het zwembassin kan je aanmeren met een sloepje. Het Lutjestrand is de perfecte plek om te recreëren of voor het watersporten; varen, sup'pen, kiten en windsurfen. Het kan hier allemaal!\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4577b974cb2998dd110b",name:"Zandkuilweg",coordinates:"52.89256706469678, 4.916956369218754",description:e,description_en:e,description_de:e,enabled:a,category:b},{id:"62ee45b2b974cb2998dd110c",name:"Westerlander Koog",coordinates:"52.88648538198326, 4.923295047003467",enabled:a,category:b},{id:"62ee4639b974cb2998dd110d",name:"Eendenkooi",coordinates:"52.89437870657819, 4.942364059485017",description:e,enabled:a,category:b},{id:"62ee465bb974cb2998dd110e",name:"De steen van Westerklief",coordinates:"52.89770512547304, 4.952907719058381",description:"\u003Cp\u003EDit is een oud deel van Wieringen, waar overwegend boeren woonden. De klieven behoren tot de hogere delen van Wieringen. De Varkensgrasweg en de Hoelm liggen tussen Westerklief en Westerland. Westerklief is bekend geworden door de “stien.“ Deze steen dateert uit de voorlaatste ijstijd en is één van de grootste uit deze periode. Van de stien werd aan de kinderen verteld dat deze zich zou omkeren als hij de klok hoorde slaan. Veel kinderen hebben daar tevergeefs op gewacht.&nbsp;\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThis is an old part of Wieringen, where mainly farmers lived. The clefts belong to the higher parts of Wieringen. The Varkensgrasweg and the Hoelm are located between Westerklief and Westerland. Westerklief is known for the \"stien.\" This stone dates from the penultimate ice age and is one of the largest from this period. The children were told that the stien would turn when he heard the clock chime. Many children have waited in vain for this.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDies ist ein alter Teil von Wieringen, wo hauptsächlich Bauern lebten. Die Klüfte gehören zu den höheren Lagen von Wieringen. Der Varkensgrasweg und die Hoelm liegen zwischen Westerklief und Westerland. Westerklief ist bekannt für den „Stien.“ Dieser Stein stammt aus der vorletzten Eiszeit und ist einer der größten aus dieser Zeit. Den Kindern wurde gesagt, dass sich der Stien drehen würde, wenn er die Uhr läuten hörte. Darauf haben viele Kinder vergeblich gewartet.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4688b974cb2998dd110f",name:"Vindplaats Vikingschat",coordinates:"52.89551032381738, 4.947517256835575",description:e,description_en:e,description_de:e,enabled:a,category:b},{id:"62ee46adb974cb2998dd1110",name:"Oude Zeedijk 'Wierdijk'",coordinates:"52.89022802999927, 4.9419844325977484",enabled:a,category:b},{id:"62ee46f5b974cb2998dd1111",name:"Vogeluitkijk op de de dijk",coordinates:"52.90555681966286, 4.9411265301123795",enabled:a,category:b},{id:"62ee4718b974cb2998dd1112",name:"Natuurgebied Normerven",coordinates:"52.90712513906179, 4.938923552162519",enabled:a,category:b},{id:"62ee474eb974cb2998dd1113",name:"Marskepoeltjes",coordinates:"52.91248375346352, 4.951064414139313",enabled:a,category:b},{id:"62ee4768b974cb2998dd1114",name:"Kooibos bij Hippo",coordinates:"52.900039264946685, 4.968273697843227",enabled:a,category:b},{id:"62ee4781b974cb2998dd1115",name:"'t Witte Bruggetje",coordinates:"52.89247690857845, 4.9765819418689645",enabled:a,category:b},{id:"62ee479eb974cb2998dd1116",name:"Kobus' Gemaaltje",coordinates:"52.89572949634843, 4.979786290020994",enabled:a,category:b},{id:"62ee47b8b974cb2998dd1117",name:"Hippolytushoever Koog",coordinates:"52.899649842101375, 4.979826839203257",enabled:a,category:b},{id:"62ee47f1b974cb2998dd1118",name:"Info Oude Zeedijk 'Wierdijk'",coordinates:"52.909578579180945, 4.989193782310755",enabled:a,category:b},{id:"62ee4821b974cb2998dd1119",name:"'T Kraaiegat",coordinates:"52.92868292264288, 4.9677479970615135",enabled:a,category:b},{id:"62ee4854b974cb2998dd111a",name:"Uitkijktoren",coordinates:"52.93058751038826, 4.972814308317939",enabled:a,category:b},{id:"62ee486fb974cb2998dd111b",name:"Oude Zeewering",coordinates:"52.931911761262874, 4.9817769603410325",enabled:a,category:b},{id:"62ee487fb974cb2998dd111c",name:"Vatrop",coordinates:"52.93061005503834, 4.98573103092149",enabled:a,category:b},{id:"62ee48a8b974cb2998dd111d",name:"Stroeër Koog",coordinates:"52.918954248649534, 4.980201420989235",enabled:a,category:b},{id:"62ee48cbb974cb2998dd111e",name:"Polder Waardnieuwland",coordinates:"52.90903723833209, 4.998819726338872",enabled:a,category:b},{id:"62ee48dfb974cb2998dd111f",name:"Vis Kringloop",coordinates:"52.90235160335398, 5.011106582694135",enabled:a,category:b},{id:"62ee4915b974cb2998dd1120",name:"Robbenoordbos",coordinates:"52.89974715653432, 5.038325583852444",enabled:a,category:b},{id:"62ee4953b974cb2998dd1121",name:"Dijkgatbos",coordinates:"52.88959913932523, 5.069725719013265",enabled:a,category:b},{id:"62ee4975b974cb2998dd1122",name:"Het Wierholt",coordinates:"52.901436208992386, 5.048928685673996",enabled:a,category:b},{id:"62ee4987b974cb2998dd1123",name:"Gat in de Dijk",coordinates:"52.892917473472146, 5.074653988265094",enabled:a,category:b},{id:"62ee49aab974cb2998dd1124",name:"Mountainbike route",coordinates:"52.88282535741905, 5.080824402407162",enabled:a,category:b},{id:"62ee49beb974cb2998dd1125",name:"Marina Den Oever",coordinates:"52.92438965540562, 5.046058456751461",enabled:a,category:b},{id:"62ee49cfb974cb2998dd1126",name:"Strand Zuiderhaven",coordinates:"52.931518603434775, 5.0395901309070075",enabled:a,category:b},{id:"62ee49dbb974cb2998dd1127",name:"Zeesluis",coordinates:"52.93403408418654, 5.042000395739004",enabled:a,category:b},{id:"62ee49ebb974cb2998dd1128",name:"Spuisluizen",coordinates:"52.936125339382905, 5.046100364203987",enabled:a,category:b},{id:"62ee4a10b974cb2998dd1129",name:"Duitse bunker",coordinates:"52.93703334753622, 5.040764018008853",enabled:a,category:b},{id:"62ee4a2ab974cb2998dd112a",name:"Natuurgebied Het Schor",coordinates:"52.93769220088095, 5.025170149416869",enabled:a,category:b},{id:"62ee4a44b974cb2998dd112b",name:"Televisietoren",coordinates:"52.908366297563155, 5.058501943375163",enabled:a,category:b}],categories:[b,"Routes",void 0],routes:[{id:"64b9a29d4b72a00df704c8f8",name:"Haven Route",description:c,description_en:c,description_de:c,file:"haven",km:"4.5",image:"haven.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fhavenroute-rood\u002F56403",isWalk:a},{id:"64b9a3a34b72a00df704c8fa",name:"Westerklief Route",description:c,description_en:c,description_de:c,file:"westerklief",km:"4.7",image:"westerklief.jpeg",isBike:u,isWalk:a},{id:"64b99fd54b72a00df704c8f3",name:"Wierdijk Route",description:c,description_en:c,description_de:c,file:"wierdijk",km:"7",image:"wierdijk.jpg",isBike:u,isWalk:a},{id:"64b99f174b72a00df704c8f1",name:v,description:c,description_en:c,description_de:c,file:"stroe-bike",km:"8",image:w,isBike:a},{id:"64b99f534b72a00df704c8f2",name:v,description:c,description_en:c,description_de:c,file:"stroe",km:"8.3",image:w,isWalk:a},{id:"64b9a1c04b72a00df704c8f6",name:"Oosterland Route",description:c,description_en:c,description_de:c,file:"oosterland",km:"9.7",image:"oosterland.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Foosterlandroute-blauw\u002F56405",isBike:a,isWalk:a},{id:"64b9a3034b72a00df704c8f9",name:"Quarantaine Route",description:c,description_en:c,description_de:c,file:"quarantaine",km:"12",image:"quarantaine.jpg",isBike:a},{id:"64b9a0bc4b72a00df704c8f4",name:"Amstelmeer Route",description:c,description_en:c,description_de:c,file:"amstelmeer",km:"22",image:"amstelmeer.jpg",isBike:a,isWalk:a},{id:"64b9a2334b72a00df704c8f7",name:"Willibrord Route",description:c,description_en:c,description_de:c,file:"willibrord",km:"26.8",image:x,url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fin-het-voetspoor-van-de-heilige-willibrord\u002F83791",isWalk:a},{id:"64b9a1384b72a00df704c8f5",name:"Wieringen Route",description:c,description_en:c,description_de:c,file:"wieringen",km:"28",image:x,isBike:a}]},__i18n:{langs:{nl:{common:{"404":"Deze pagina is niet gevonden",title:"A simple example",subtitle:"It's a blank-page. Start to build your'e page from here.",error_with_status:"Er is iets fout gegaan","404_subtitle":"Je kan hier blijven of terug gaan naar de homepagina.",back:"Terug naar home",error_without_status:"An error occurred on the server",cookies_accept:"Accepteren",cookies:"Wij maken gebruik van cookies om uw ervaring te optimaliseren. Lees",cookies2:"hier",cookies3:"meer.",en:"Engels",nl:"Nederlands",de:"Duits",created_by:"Gemaakt door"},ow:{welcome:"Welkom!",about_text1:"De geschiedenis van het oude eiland Wieringen gaat tot vele eeuwen terug. Het glooiende landschap is ontstaan in de laatste ijstijd. De hoogtes en laagtes zie je overal terug wanneer je over de vele weggetjes wandelt of fietst. Gaandeweg ontdek je steeds meer mooie uitzichten over het landschap en het zoete en zoute water.",about_text2:"Op Wieringen voel je de geschiedenis. Diverse musea bieden een kijkje in de verrassende wereld van boeren, vissers en vikingen.",about_text3:"In de knusse dorpen op Wieringen is er altijd wat te zien en te beleven. Hier vind je de leukste winkeltjes en (lokale) producten. In de zomerperiode worden diverse gezellige evenementen georganiseerd, van markten tot kermissen.",about_text4:"Verscheidene restaurants en horeca bieden een heerlijk moment om even te genieten van het leven. Neem zeker even een bezoek en geniet van de goede (lokale) vis- en vleesproducten. Of neem een lekker tussendoortje langs de weg.",about_text5:"Voor bezoekers aan Wieringen zijn diverse overnachtingsplekken beschikbaar, van camperplaats en campings tot verschillende b&b. Wieringen is beslist de moeite waard om meerdere dagen te verkennen.",searching_for:"Ontdek Wieringen:",close:"Sluiten",site:"Website","header_#agenda":"Agenda","header_#wieringen":y,"header_#partners":z,"header_#kaart":A,"header_#legenda":B,Overnachten:n,Winkels:d,Bezienswaardigheden:b,Bedrijven:p,Recreatie:m,"Uitgaan & Eten":f,Cultuur:g,header_language:"Taal",legenda:B,header_kaart:A,header_contact:C,header_companies:z,view_map:"Bekijk hier de kaart!",about_text:"Welkom op Wieringen, een pittoresk juweeltje in Nederland! Genesteld tussen de uitgestrekte velden en de glinsterende Waddenzee, is Wieringen een betoverend eiland dat wacht om ontdekt te worden. Met zijn rijke geschiedenis, adembenemende landschappen en levendige gemeenschap biedt Wieringen een onvergetelijke reiservaring. Ontsnap aan de drukte van de stad en laat je betoveren door de rustige charme van dit verborgen pareltje. Of je nu op zoek bent naar avontuurlijke buitenactiviteiten, culturele ontdekkingen of gewoon ontspanning, Wieringen heeft voor elk wat wils. Verken historische monumenten, maak een wandeling langs de kronkelende dijken, proef de lokale gastronomie en geniet van de warme gastvrijheid van de Wieringers. Begin je reis naar Wieringen vandaag nog en dompel jezelf onder in de magie van dit unieke stukje Nederland!",about2_title:y,about2_schat_title:"Vikingschat",about2_schat_text:"Voor degenen die Wieringen niet kennen, Wieringen is oud, heel oud. Zo hebben de Vikingen het in ca. 850 na Christus vereerd met een bezoek, getuige de Vikingschat die in 1996 is gevonden en tentoongesteld ligt in het Rijksmuseum van Oudheden in Leiden. Wieringen was tot halverwege de jaren ’20 van de vorige eeuw een klein eiland in de Zuiderzee.",about2_kotter_title:"Dorpjes",about2_kotter_text:"Het voormalig eiland bestaat uit de dorpen Den Oever, Oosterland, Hippolytushoef en Westerland. Daarnaast zijn er diverse buurtschappen. Het landschap is licht glooiend. Diverse oude gebouwen zijn bewaard gebleven en prachtig gerestaureerd, zoals een van de oudste kerken van Nederland, de Michaëlskerk in Oosterland uit de vroege 12e eeuw. De andere dorpen hebben ook zo hun karakteristieke punten. Den Oever kenmerkt zich door de haven, waar wekelijks een verse vismarkt wordt gehouden, en de prachtige korenmolen uit 1672 in het midden van het dorp. Hippolytushoef is het grootste dorp met de grote kerk trots als middelpunt en eromheen enkele historische panden. Westerland heeft het hoogstgelegen punt van het voormalig eiland en grenst aan het Amstelmeer.",about2_wieringen_title:g,about2_wieringen_text:"Wieringen kent een eigen dialect. Helaas zijn er niet veel mensen meer die het goed spreken. Hoewel dit erg jammer is, heeft het voor bezoekers een voordeel: U zult geen moeite hebben de mensen te verstaan. Hoewel er nog veel meer is te zeggen over het voormalig eiland, de dorpen, de buurtschappen en de bewoners, nodigen we u vooral uit om het zelf te ondervinden en... “Efkes een rongdje te lópe…”",back_home:"Terug naar de homepagina",back_to_map:"Terug naar de kaart",route:"Route",contact:C,contact_text:"Heeft u een vraag of wilt u meer informatie over een van onze producten? Gebruik onderstaand contactformulier en wij nemen zo spoedig mogelijk contact met u op.",contact_name:"Naam",contact_email:"Email",contact_message:"Bericht",contact_phone:"Telefoon",contact_company:"Bedrijfsnaam",contact_business:"Zakelijk",contact_submit:"Versturen",contact_success:"Bericht verstuurd! Wij zullen zo spoedig mogelijk reageren.",contact_error:"Er is iets fout gegaan, probeer het later opnieuw.",footer_link:"Links",more:"Meer",phone_contact:q,email_contact:"info@kleimeerassurantien.nl",required:"Vereist",email_invalid:"Verkeerd E-mailadres",map:"terug"}}}}}}(true,"Bezienswaardigheden","\u003Cp\u003E\u003Cspan style=\"color: rgba(255, 255, 255, 0.698);\"\u003ERoute omschrijving hier\u003C\u002Fspan\u003E\u003C\u002Fp\u003E","Winkels","","Uitgaan & Eten","Cultuur","smDown","mdDown","lgDown","xl","xsDown","Recreatie","Overnachten",null,"Bedrijven","0227609801","info@degrootrecreatie.nl","0651806581","0227510467",false,"Stroe Route","stroe.jpg","wieringen.jpg","Wieringen","Partners","Kaart","Legenda","Contact"));